INSERT INTO `article_translations` VALUES (1,15,'ru','Поход в горы за Морское осенью.','Горы в ноябре','Крымские горы красивы в любое время года. Конечно, всегда по своему. Летний звенящий зной, весенние туманы или зимняя чистая свежесть соревнуются в живописности с меланхолией осени.\r\nМесто назначения - горы возле поселка Морское. Едем по Южной дороге от Морского по напрвлению к Ялте. Сворачиваем направо - на Зеленогорье. По узкому асфальту проезжаем еще несколько километров по долине с редкими виноградниками. \r\nСнизу видны только ближайшие холмы и вершины далеких гор. Подняться наверх несложно, горы невысокие и достаточно пологие. Там, наверху, открывается вид на вершины более высоких гор к северу.  ','2010-03-03 11:34:23','2010-03-03 11:34:23'),(2,14,'ru','Дорога на Солнечную долину через поля винограда.','Осенние виноградники','Проезжая осенью виноградными полями, можно наблюдать ковры насыщенных пастельных оттенков, которые могут менять свой цвет буквально с каждым поворотом дороги. Различные сорта винограда перед зимой окрашивают свои, уже не нужные, листья тонами желто-зелено-красно-бордовых красок, давая множество пищи для размышлений художникам, а остальным возможность просто любоваться. Из винограда именно с этих полей делается вино торговой марки \"Солнечная Долина\". ','2010-03-03 11:36:57','2010-03-03 16:22:05'),(3,13,'ru','Прогулка недалеко от Солнечной Долины.','Возле Солнечной Долины','Солнечная Долина - небольшой поселок, расположенный в довольно живописном месте. С севера его окружают горы, многие из которых имеют характерный скалистый гребень, до моря расстояние составляет около одного километра. Добраться из Судака в Солнечную Долину можно двумя путями - трассой Судак-Феодосия или дорогой, пролегающей через Капсельскую долину и Богатовку. Эта дорога обычно более интересна для тех, кто хочет увидеть различные местные пейзажи и ландшафты. И хоть, в конечном итоге, и эта дорога выше Солнечной Долины поворачивает на феодосийскую, путь, огибающий мыс Меганом и петляющий холмами и виноградниками может оставить у Вас достаточно яркие впечатления. Пешие-же прогулки окрестными холмами обязательно добавят яркости этим впечатлениям.','2010-03-03 11:37:45','2010-03-03 11:37:45'),(4,12,'ru','Виды с холмов к северу от мыса Меганом.','Возле озера Бугаз','Если сойти с дороги из Богатовки в Солнечную Долину и пройтись по красивым холмам, поросших редким сосновым лесом, можно убедится в том, что Восточный Крым и окрестности Судака в том числе, отличается большим разнообразием видов и ландшафтов. Все представленные снимки сделаны практически из одного места. Часто для того чтобы сменить, например, пляж на горные тропы, или густой лес на солончаковую пустыню, достаточно двадцатиминутной пешей прогулки. При наличии машины или катера возможности становятся еще большими.    ','2010-03-03 11:38:40','2010-03-03 11:38:40'),(5,10,'ru','Популярное место \"дикого\" отдыха в межсезонье.','Бухты возле Морского','Местным жителям часто летом приходится слышать от приезжих вопрос: - А у вас зима тут вообще бывает? Людям, которые видели Крым только в период июнь-август, сложно наверное представить. что бурлящий курортный муравейник на самом деле - меньшая часть местного календарного круга. Пляжи, сплошь устланые загорающими телами, впритык заставленные зонтами, навесами, палатками и  машинами в межсезонье приобретают вид почти первозданной чистоты. Зимние штормы и дожди имеют достаточно времени смыть все следы и человеческих радостей и проблем. Бухты к западу от Морского пользуются заслуженой популярностью среди отдыхающих, предпочитающих для отдыха палатки и машины более капитальным строениям. Южная дорога от Судака к Большой Ялте идет возле Морского по самому побережью, позже поднимаясь вверх и спускаясь вниз на бесчисленных поворотах столько-же утомительной как и интересной горной асфальтовой ленты.     ','2010-03-03 11:39:32','2010-03-03 11:39:32'),(6,9,'ru','Поездка катером в Гравийную бухту. ','Гравийная бухта ','Одним из мест поблизости Судака, куда интереснее добираться морем, является бухта Гравийная на мысе Меганом. Посадка на маленький катер происходит на причале спасательной станции недалеко от центрального пляжа. Учтите, что чем меньше размеры плавательного средства, тем сильнее его качает. И даже если на вид море достаточно на Ваш взгляд спокойное, то не факт что никто не пострадает от морской болезни. Но до Гравийной бухты добираться всего пару десятков минут, так что положительные эмоции от поездки с лихвой перекроют маленькие неудобства. Хотя отдых - дело само по себе достаточно нелегкое, но это отдельная тема. Высадка происходит прямо на прибрежные скалы. Вы попадаете в уютную галечную бухту, над которой крутым склоном поднимаются скалы самого Меганома.  Гравийная бухта известна главным образом чистотой воды и красивым видом на побережье к западу от Судака. Если вид моря на городском пляже не вызывает у Вас большого желания в него нырнуть, съездите в Гравийную. ','2010-03-03 11:40:44','2010-03-03 16:40:12'),(7,8,'ru','Вид на побережье со склона мыса Меганом.','Поднимаясь на Меганом','Много в Крыму приятностей и полезностей, но самым важным, тем, ради чего, собственно, все и едут сюда является, конечно, море. Оно покоряет, завораживает, заставляет возвращаться к себе снова и снова. Море имеет много образов, и его образ при виде сверху, с какой-нибудь горы, тоже другой. Причины этого, конечно, и в том что свет в этом случае по другому отражается от воды, и в том, что существенно расширяется панорама, и прочие, в общем, неважные моменты. Море притягивает. ','2010-03-03 11:41:34','2010-03-03 16:45:36'),(8,7,'ru','Что можно увидеть на вершине одной из красивейших гор Судака?','На вершине горы Сокол','Не все люди понимают и любят походы в горы. Ради чего нужно на жаре в 35 градусов по осыпающимся склонам лезть на какое-то возвышение, которое умный человек конечно-же обойдет? Мне кажется, самое важное тут - это на что смотреть. Смотреть нужно не под ноги (ну иногда и под ноги конечно надо), не только на спутника или спутницу,  а вокруг. Вокруг - в самом широком смысле этого слова. Тогда становится понятно, что прямо под нами, под вот этими ногами - Планета. Гришковцу - респект, копирайт соблюден.   ','2010-03-03 11:42:31','2010-03-03 11:42:31'),(9,6,'ru','Виноградные поля осенью.','Поля возле Морского','Осень в Крыму - время успокоения. Хотя еще достаточно тепло, все приобретает вид расслабленый и медитативный. Пропадают летние контрасты, слепящие глаза отражения, неуемный треск цикад и чувство, которое точнее всего можно передать как усталость от жары. Море, горы, холмы и все вокруг неожиданно тусклеет. Нечастые пятна ярких красок лишь точечно рвут эту тусклость последними вспышками перед почти совсем бесцветными зимними месяцами.     ','2010-03-03 11:43:34','2010-03-03 11:43:34'),(10,5,'ru','Виды с вершины горы Сокол.','На горе Сокол','Гора Сокол видна почти из всех точек Судака. Запоминающийся образ горы притягивает к себе большое количество желающих покорить ее вершину. Сделать это несложно. Существует два основных маршрута. Первый - подъем возле скалы Чертов Палец со стороны Судака - можно рекомендовать только людям подготовленным. Второй - подъем по тропе от Нового Света - можно смело осваивать любому здоровому человеку. Из Судака можно покорять Сокол в составе экскурсии с опытным проводником, который  расскажет много интересного. Те, кто решил положиться только на себя, тоже не пожалеют - они смогут идти в любом желаемом для них темпе и свободно распоряжаться своим временем. Высота Сокола более четырехсот метров. Со стороны моря гора имеет почти отвесную стену, на которой часто пробуют свои силы альпинисты. ','2010-03-03 11:44:27','2010-03-03 11:44:27'),(11,4,'ru','Прогулка недалеко от горы Перчем.','Горы возле Судака','Одним из многих преимуществ Судака как места для отдыха людей активных и интересующихся природой является наличие большого количества интереснейших маршрутов совсем недалеко от города. Окружающие Судак горы, несмотря на свою небольшую высоту, могут дать любому, кто потратит на них немного сил и времени, большое количество впечатлений. На востоке от Судака привлекают своими размерами и видом горы Перчем и Сокол. И хотя принято считать что именно с вершин гор открывается самый захватывающий вид, прогулка многочисленными запутанными тропинками возле их подножий способна представить Вашему вниманию не меньше интересных и, подчас захватывающих, видов крымской природы.       ','2010-03-03 11:45:43','2010-03-03 17:35:05'),(12,3,'ru','Спуск с дороги на Новый Свет к морю. ','Тропинка на дикий пляж','Дорога из Судака в Новый Свет, которая многочисленными поворотами огибает крутые горные склоны, сама по себе интересна и живописна. Тут снято огромное количество фильмов и музыкальных клипов. Но сейчас мы оставим машину в одном из \"карманов\" и спустимся вниз, к морю. С тропы можно снизу рассмотреть почти отвесную стену горы Сокол. Считается что в давние времена это был живой коралловый риф, именно поэтому гора имеет такую специфическую форму. Территория под Соколом до самого Нового Света объявлена ботаническим заказником. Воздух тут действительно особенный, имеет приятный запах можжевельника и каких-то других растений. Тропинка спускается на каменистый дикий пляж. Лишь местами на берегу есть песчаные участки. Людей сдесь немного, но учтите что это место довольно популярно у нудистов.  ','2010-03-03 11:46:42','2010-03-03 11:46:42'),(13,35,'ru','Зимнее кормление лебедей и других морских птиц.','Морские птицы','Иногда, но не каждый год, в Судаке остаются на зимовку лебеди. В трудное холодное время они всей стаей подплывают к самому берегу, туда, где люди бросают хлеб. Птицы жадно бросаются за пищей, создавая давку и отбирая друг у друга добычу. Кроме лебедей, активными участниками дележа являются чайки. Обладая более высокой скоростью и маневренностью, а также немалой наглостью,они часто успевают выхватить куски хлеба прямо из-под клюва вальяжных лебедей. То тут то там мелькают черные нырки. Они значительно меньше лебедей и намного скромнее чаек, поэтому подбирают то, что не заметили другие птицы. Но в некоторые дни так много желающих подкормить птиц приходит на берег, что лебеди, наевшись, отплывают чуть дальше, игнорируя всю пищу. \r\nДля местных жителей кормление лебедей давно стало своеобразным праздником. Стая голубей носится над пляжем, подбирая крошки с песка, бегают собаки, дети радуются возможности покормить лебедей и других птиц почти с рук, суматошная борьба за лучшие куски в воде - весёлое и яркое зрелище в межсезонье.     ','2010-03-03 11:50:04','2010-03-03 17:42:32'),(14,34,'ru','Ночные огни судакской набережной.','Набережная ночью','Летний вечер в Судаке всегда приносит с собой ощущение праздника. И его центром конечно является набережная. Вечернее море, отражающее огни кафе и катеров, прохлада, пришедшая на смену дневному звенящему зною, нарядно одетая гуляющая курортная публика - все это манит и притягивает. Но если Вы немного устали от шумных ресторанов и дискотек, то достаточно выйти к пляжу и вдохнуть глоток свежего морского бриза, и Вы почувствуете совсем другую ночь - ночь тихого шелеста волн и загадочного ночного моря. Дорожки отражений от луны, береговых огней и иллюминации катеров и теплоходов мягко стелятся по водной поверхности, которая ещё успевает передать последние отсветы вечернего неба. Если у вас будет возможность - обязательно попробуйте искупаться в море ночью. Хотя должен предупредить что это запрещено - купаться ночью считается небезопасным занятием и, к тому-же, на ночь городские пляжи закрываются. И еще повод для беспокойства - частенько ночные купальщики не могут найти некоторых своих вещей, опрометчиво оставленных на пляже без присмотра. Но все проблемы решаемы, и если вам все-таки удастся искупаться в море ночью, я уверен, вы получите незабываемые впечатления.      ','2010-03-03 11:50:52','2010-03-03 11:50:52'),(15,11,'ru','Виды с набережной Судака в ясную погоду.','Море и облака','Большие объемы воды притягивают человека. Морем многие люди могут любоваться часами, ведь оно постоянно меняется. Иногда цвет моря может казаться \"неправильным\" - серым, зеленым, коричневым и даже бордовым. Это хорошо видно, ведь всегда есть эталон - голубое небо. Белые облака в ясную погоду добавляют в морские пейзажи легкости и разнообразия.','2010-03-03 11:51:39','2010-03-03 11:51:39'),(16,43,'ru','Прекрасное место для дайверов.','Гравийная Бухта - дикий пляж','В Гравийной бухте на мысе Меганом есть прекрасный маленький пляж с чистейшей водой, окруженный со всех сторон, кроме южной, высокими скалами. Отдых здесь подойдёт не всем, но если Вы любите проводить время на природе, это место имеет все шансы Вас очаровать. Если вы любитель дайвинга, то Гравийную бухту Вам пропустить нельзя никак. Она славится именно чистотой воды, почти уникальной для Чёрного моря.      ','2010-03-03 11:52:42','2010-03-03 17:54:02'),(17,42,'ru','Пляж Судака зимой.','Зимний пляж','Многих интересует вопрос - замерзает-ли море зимой? Чёрное море в районе Судака не замерзает никогда. Даже если температура воздуха опускается до двадцати градусов мороза (бывает и такое, правда довольно редко) и на земле лежит снег, моря играет волнами так-же как и в другие времена года. Только в полосе прибоя на камнях или на сваях пристаней могут образовываться ледяные наросты.\r\nТемпература морской воды зимой - около 8 градусов, именно поэтому в прибрежной зоне зима значительно теплее чем, скажем, даже километров на 40 вглубь полуострова. Но по этой-же причине весна на побережье обычно холодная и затяжная. Пока огромные массы воды не прогреются лучами весеннего солнца, до тех пор промозглые туманы будут почти ежедневно накрывать поля и долины меж гор. Для тех, кто хочет приехать в Судак на отдых именно весной, стоит учесть этот момент. \r\nНо пока идет зима. Безлюдные пляжи на холоде потеряли свои летние яркие краски и сменили их на мягкие авкварельные тона. ','2010-03-03 11:53:24','2010-03-10 17:40:46'),(18,41,'ru','Зимний пляж в штормовую погоду.','Зимнее море','Летом шторм в районе Судака бывает редко. Море выплескивает все свои эмоции в другие времена года. В основном - зимой. Зимой море становится совсем другим - холодным и суровым. От летней лёгкости и приятного шелеста прозрачных волн не остаётся и следа. Тёмно-серое, стальное, грязно-зелёное, чёрное, коричневое - вот цвета моря зимнего. Холодный пронизывающий ветер гонит на пустые пляжи тёмные волны, покрытые клочьями белой пены. Волна бросается на берег, потом отступает, ненадолго оставляя постепенно исчезающую блестящую плоскость песка. \r\n','2010-03-03 11:54:06','2010-04-05 16:47:26'),(19,40,'ru','Популярные загородные пляжи.','Пляжи возле Морского','В посёлке Морское, который расположен на берегу моря к западу от Судака, есть хороший большой пляж. Но если проехать немного дальше в направлении Алушты, то Вы увидите две широкие бухты. Машину можно оставить на обочине или даже съехать вниз, на сам пляж. Тут можно поставить тент или палатку и остановиться не несколько дней. В отличие от Судака, пляжи которого находятся в пределах сравнительно небольшой бухты, тут берег более открыт. Горы не подступают слишком близко к воде и можно в полной мере ощутить морской простор.        ','2010-03-03 11:54:55','2010-03-03 11:54:55'),(20,39,'ru','Популярный загородный пляж и кемпинг.','Пляжи Капсельской долины','Самым доступным и, вероятно, популярным кемпингом Судака является капсельские пляжи под мысом Меганом. Хотя здешний ландшафт довольно своеобразный и напоминает пустыню (на самом деле это и есть солончаковая пустыня), а пляжи благоустроены не полностью, это место стало альтернативой часто переполненому городскому пляжу Судака. На машине не составит труда проехать несколько километров вдоль моря, чтобы попасть сюда. К воде можно подъехать, можно поставить палатку и жить постоянно. Пляжи тут разные - есть песчаные, гравийные и каменистые, выбирайте на свой вкус. С пляжа можно любоваться прекрасным видом на Новый Свет и на более далёкое побережье за ним - до самой Медведь-горы, которая хорошо видна в ясную погоду.','2010-03-03 11:55:46','2010-03-10 18:15:39'),(21,33,'ru','Один из целой сети небольших винных магазинов известной торговой марки.','Магазин Вина Солнечной долины','Один из целой сети небольших винных магазинов известной торговой марки.','2010-03-03 11:57:21','2010-03-03 11:57:21'),(22,32,'ru','Автостоянка возле основной курортной зоны Судака.','Автостоянка возле Кипарисовой аллеи','Платная автостоянка возле основной курортной зоны Судака. ','2010-03-03 11:58:06','2010-03-03 12:00:07'),(23,31,'ru','Городская почта','Отделение почты и связи Укртелеком','Отделение Укртелекома предоставляет все основные профильные услуги.','2010-03-03 13:28:25','2010-03-03 13:28:25'),(24,30,'ru','Кинотеатр Чайка расположен практически в центре Судака.','Кинотеатр Чайка','Кинотеатр Чайка расположен практически в центре Судака.','2010-03-03 13:29:08','2010-03-03 13:29:08'),(25,29,'ru','Современная аптека на центральной улице Судака. ','Аптека Мед-Сервис','Современная аптека на центральной улице Судака. ','2010-03-03 13:29:58','2010-03-03 13:29:58'),(26,28,'ru','Одна из крупнейших гостиниц Судака. ','Гостиница Форум','При гостинице есть ресторан, бар, фитнесс-центр.','2010-03-03 13:31:07','2010-03-03 13:31:07'),(27,27,'ru','Одна из старейших гостиниц Судака.','Гостиница Сурож','Удобно расположенная гостиница с уютным ландшафтным двориком.','2010-03-03 13:32:03','2010-03-10 18:43:18'),(28,26,'ru','Гостиница на углу улиц Ленина и Кипарисовой аллеи.','Гостиница Royal','Гостиница с небольшим торговым центром.','2010-03-03 13:33:29','2010-03-10 18:46:03'),(29,25,'ru','Столовая на центральной улице Судака.','Столовая №1','Столовая предлагает недорогое меню а также пиццу.','2010-03-03 13:34:32','2010-03-10 18:48:27'),(30,24,'ru','Уютное кафе на углу одной из наиболее популярных у приезжих улицы - Спендиарова.','Кафе на углу улиц Ленина и Спендиарова','Уютное кафе на углу одной из наиболее популярных у приезжих улицы - Спендиарова.','2010-03-03 13:35:34','2010-03-03 13:35:34'),(31,23,'ru','Магазин продуктов на центральныой улице Ленина.','Мини-маркет Юг','Удобно расположенный магазин продуктов.','2010-03-03 13:38:03','2010-03-03 13:38:03'),(32,22,'ru','Небольшой магазин на центральной улице Ленина.','Магазин продуктов','Магазин находится на пути из центра Судака и более дальних районов к центральному пляжу.','2010-03-03 14:03:31','2010-03-03 14:03:31'),(33,21,'ru','Удобно расположенный магазин.','Магазин продуктов на углу улиц Ленина и Спендиарова','В магазине представлен широкий выбор продуктов. ','2010-03-03 14:04:25','2010-03-03 14:04:25'),(34,20,'ru','Отделение известного в Украине банка','Отделение Приватбанка','Отделение Приватбанка расположено возле гостиницы Форум.','2010-03-03 14:05:20','2010-03-03 14:05:20'),(35,19,'ru','Отделение банка Петрокоммерц','Судакское отделение банка Петрокоммерц','Отделение банка Петрокоммерц расположено практически в центре города.','2010-03-03 14:06:33','2010-03-03 14:06:33'),(36,18,'ru','В этом небольшом, но удобно расположенном отделении, Вы можете воспользоваться всеми основными услугами известного банка.','Мини-отделение Приватбанка','В этом небольшом, но удобно расположенном отделении, Вы можете воспользоваться всеми основными услугами известного банка.','2010-03-03 14:07:38','2010-03-03 14:07:38'),(37,17,'ru','Недорогое жилье, уютный двор.','Недорогие номера, до пляжа - 700 метров','Найти недорогое и удобное место для отдыха в Судаке вполне реально. Гостеприимные хозяева предлагают двух, трех и четырехместные номера с мая по октябрь. Звоните (телефоны в Украине): Киевстар +380 98-101-21-52, Лайф +380 93-575-26-41.','2010-03-03 14:09:39','2010-04-23 19:46:45'),(38,16,'ru','Недорогое жилье, уютный двор. До пляжа менее 700 метров.','Недорогой отдых на улице Пограничников','Найти недорогое и удобное место для отдыха в Судаке вполне реально. Гостеприимные хозяева предлагают двух, трех и четырехместные номера с мая по октябрь. Звоните (телефоны в Украине): Киевстар +380 98-101-21-52, Лайф +380 93-575-26-41.','2010-03-03 14:10:26','2010-04-23 19:45:49'),(39,15,'uk','Похід в гори за Морське восени.','Гори в листопаді','Кримські гори красиві в будь-яку пору року. Звичайно, завжди по-своєму. Літня дзвінка спека, весняні тумани чи зимова чист свіжість змагаються в мальовничості з меланхолією осені. \r\nМісце призначення - гори біля селища Морське. Їдем по Південній дорозі від Морського за напрямами до Ялти. Звертаємо направо - на Зеленогір\'я. По вузькому асфальту проїжджаємо ще кілька кілометрів по долині з рідкісними виноградниками. \r\nЗнизу видно тільки найближчі горби й вершини далеких гір. Піднятися догори нескладно, гори невисокі і досить пологі. Там, нагорі, відкривається вид на вершини більш високих гір на північ.','2010-03-03 16:17:44','2010-03-03 16:17:44'),(40,14,'uk','Дорога на Сонячну долину через поля винограду.','Виноградники восени','Проїжджаючи восени виноградними полями, можна спостерігати килими насичених пастельних відтінків, які можуть змінювати свій колір буквально з кожним поворотом дороги. Різні сорти винограду перед зимою фарбують свої, вже не потрібні, листя тонами жовто-зелено-червоно-бордових фарб, даючи багато поживи для роздумів художникам, а іншим - можливість просто милуватися. З винограду саме з цих полів робиться вино торгової марки \"Сонячна Долина\".','2010-03-03 16:21:24','2010-03-03 16:21:24'),(41,13,'uk','Прогулянка недалеко від Сонячної Долини.','Біля Сонячної Долини','Сонячна Долина - невелике селище, що розташоване в досить мальовничому місці. З півночі його оточують гори, багато з яких мають характерний скелястий гребінь, до моря відстань складає близько одного кілометра. Добратися з Судака в Сонячну Долину можна двома шляхами - трасою Судак-Феодосія або дорогою, що пролягає через Капсельську долину і Багатівку. Ця дорога звичайно більш цікава для тих, хто хоче побачити різні місцеві пейзажі і ландшафти. І хоч, зрештою, і ця дорога вище Сонячної Долини повертає на Феодосійський, шлях, що огинає мис Меганом, петляючі пагорбами і виноградниками може залишити у Вас досить яскраві враження. Прогулянки-ж  навколишніми пагорбами обов\'язково додадуть яскравості цим враженням.','2010-03-03 16:25:18','2010-03-03 16:25:18'),(42,12,'uk','Види з пагорбів на північ від мису Меганом.','Біля озера Бугаз','Якщо зійти з дороги з Багатівки в Сонячну Долину і пройтися по красивих пагорбах, порослих рідким сосновим лісом, можна переконатися в тому, що Східний Крим та околиці Судака у тому числі, відрізняється великою різноманітністю видів і ландшафтів. Всі представлені світлини зроблені практично з одного місця. Часто для того щоб змінити, наприклад, пляж на гірські стежки, або густий ліс на солончакову пустелю, досить двадцятихвилинної пішої прогулянки. При наявності машини або катера можливості стають ще більшими.','2010-03-03 16:28:12','2010-03-03 16:28:12'),(43,10,'uk','Популярне місце \"дикого\" відпочинку в міжсезоння.','Бухти біля Морського','Місцевим жителям влітку часто доводиться чути від приїжджих питання: - А у вас зима тут взагалі буває? Людям, які бачили Крим тільки в період червень-серпень, напевно складно уявити. що вируючий курортний мурашник насправді - менша частина місцевого календарного кола. Пляжі, суцільно вкриті засмаглими тілами, впритул заставлені парасолями, навісами, наметами і машинами, в міжсезоння набувають вигляду майже первозданної чистоти. Зимові шторми й дощі мають достатньо часу змити всі сліди і людських радостей і проблем. Бухти на захід від Морського користуються заслуженою популярністю серед відпочиваючих, які віддають перевагу наметам і машинам перед більш капітальними будівелями. Південна дорога від Судака до Великої Ялті йде біля Морського по самому узбережжю, пізніше піднімаючись вгору і спускаючись вниз на незліченних поворотах стільки-ж стомлюючої як і цікавою гірської асфальтової стрічки.','2010-03-03 16:32:36','2010-03-03 16:32:36'),(44,9,'uk','Поїздка катером в Гравійну бухту.','Гравійна бухта','Одним з місць поблизу Судака, куди цікавіше добиратися морем, є бухта Гравійна на мисі Меганом. Посадка на маленький катер відбувається на причалі рятувальної станції недалеко від центрального пляжу. Врахуйте, що чим менше розміри плавального засобу, тим сильніше його хитає. І навіть якщо на вигляд море достатньо на Ваш погляд спокійне, то не факт що ніхто не постраждає від морської хвороби. Але до Гравійної бухти добиратися всього пару десятків хвилин, так що позитивні емоції від поїздки з лишком перекриють маленькі незручності. Хоча відпочинок - справа саме по собі досить нелегка, але це окрема тема. Висадка відбувається прямо на прибережні скелі. Ви потрапляєте в затишну галькову бухту, над якою крутим схилом піднімаються скелі самого Меганома. Гравійна бухта відома головним чином чистотою води і красивим видом на узбережжя на захід від Судака. Якщо вид моря на міському пляжі не викликає у Вас великого бажання в нього пірнути, поїдьте в Гравійну.','2010-03-03 16:40:05','2010-03-03 16:40:05'),(45,8,'uk','Вид на узбережжя зі схилу мису Меганом.','Піднімаючись на Меганом','Багато в Криму приємностей і корисностей, але найважливішим, тим, заради чого, власне, все і їдуть сюди є, звичайно, море. Воно підкорює, зачаровує, змушує повертатися до себе знову і знову. Море має багато образів, і його образ при вигляді зверху, з якою-небудь гори, теж інший. Причини цього, звичайно, і в тому що світло в такому випадку по іншому відбивається від води, і в тому, що істотно розширюється панорама, та інші, загалом, неважливі моменти. Море притягує.','2010-03-03 16:45:20','2010-03-03 16:45:20'),(46,7,'uk','Що можна побачити на вершині однієї з найкрасивіших гір Судака?','На вершині гори Сокіл','Не всі люди розуміють і люблять походи в гори. Заради чого потрібно на спеці у 35 градусів по крутих схилах лізти на якесь підвищення, яке розумна людина звичайно-ж обійде? Мені здається, найважливіше тут - те, на що дивитися. Дивитися потрібно не під ноги (ну іноді і під ноги звичайно треба), не тільки на супутника або супутницю, а навколо. Навколо - в самому широкому сенсі цього слова. Тоді стає зрозуміло, що прямо під нами, під оцими ногами - Планета. Гришковцю - респект, копірайт дотриманий.','2010-03-03 16:49:49','2010-03-03 16:49:49'),(47,6,'uk','Виноградні поля восени.','Поля біля Морського','Осінь в Криму - час заспокоєння. Хоча ще досить тепло, все набуває вигляду розслаблений і медитативний. Пропадають літні контрасти, сліпучі очі відблиски, невгамовний тріск цикад і почуття, яке найточніше можна передати як втома від спеки. Море, гори, пагорби і все навколо несподівано тускніє. Нечасті плями яскравих фарб лише точково рвуть цю тьмяність останніми спалахами перед майже зовсім безбарвними зимовими місяцями.','2010-03-03 17:25:05','2010-03-03 17:25:05'),(48,5,'uk','Види з вершини гори Сокіл.','На горі Сокіл','Гору Сокіл можна бачити майже з усіх точок Судака. Своєрідний вигляд гори притягує до себе велику кількість охочих підкорити її вершину. Зробити це нескладно. Існує два основних маршрута. Перший - підйом біля скелі Чортів Палець з боку Судака - можна рекомендувати тільки людям підготовленим. Другий - підйом по стежці від Нового Світу - можна сміливо освоювати будь-якій здоровій людині. З Судака можна піднятися на Сокіл у складі екскурсії з досвідченим провідником, який розповість багато цікавого. Ті, хто вирішив покластися тільки на себе, теж не пошкодують - вони зможуть іти у будь-якому бажаному для них темпі і вільно розпоряджатися своїм часом. Висота Сокола понад чотириста метрів. З боку моря гора має майже стрімку стіну, на якій часто пробують свої сили альпіністи.','2010-03-03 17:29:22','2010-03-03 17:29:22'),(49,4,'uk','Прогулянка недалеко від гори Перчем.','Гори біля Судака','Одною з багатьох переваг Судака як місця для відпочинку людей активних і тих, що цікавляться природою, є наявність великої кількості найцікавіших маршрутів зовсім недалеко від міста. Навколишні гори, не дивлячись на свою невелику висоту, можуть дати будь-кому, хто витратить на них трохи сил і часу, велику кількість вражень. На сході від Судака приваблюють своїми розмірами і виглядом гори Перчем і Сокіл. І хоча прийнято вважати що саме з вершин гір відкривається самий захоплюючий вид, прогулянка численними заплутаними стежками біля унизу здатна дати не менше цікавих і, часом захоплюючих, видів кримської природи.','2010-03-03 17:34:59','2010-03-03 17:34:59'),(50,3,'uk','Спуск з дороги на Новий Світ до моря.','Стежка на дикий пляж','Дорога з Судака у Новий Світ, яка численними поворотами огинає круті гірські схили, сама по собі цікава й мальовнича. Тут знято величезну кількість фільмів і музичних кліпів. Але зараз ми залишимо машину в однієї з \"кишень\" та спустимося униз, до моря. Зі стежки можна  оглянути майже стрімку стіну гори Сокіл. Вважається, що в давні часи це був живий кораловий риф, саме тому гора має таку специфічну форму. Територія під Соколом аж до Нового Світу оголошена ботанічним заказником. Повітря тут дійсно особливе, має приємний запах ялівцю і якихось інших рослин. Стежка спускається на кам\'янистий дикий пляж. Лише місцями на березі є піщані ділянки. Людей сдесь небагато, але майте на увазі що це місце досить популярне у нудистів.','2010-03-03 17:38:30','2010-03-03 17:38:30'),(51,35,'uk','Зимове годування лебедів та інших морських птахів.','Морські птахи','Іноді, але не кожен рік, у Судаку залишаються на зимівлю лебеді. У важку холодну пору вони всією зграєю підпливають до самого берега, туди, де люди кидають хліб. Птахи жадібно кидаються за їжею, створюючи тисняву і відбираючи один у одного здобич. Крім лебедів, активними учасниками розподілу є чайки. Маючи більш високу швидкістю і маневреність, а також неабияку зухвалість, вони часто встигають вихопити шматки хліба прямо з-під дзьоба вальяжних лебедів. То тут то там миготять чорні нирки. Вони значно менше лебедів і набагато скромніше чайок, тому підбирають те, що не помітили інші птахи. Але в деякі дні так багато охочих підгодувати птахів приходить на берег, що лебеді, наївшись, відпливають трохи далі, ігноруючи всю їжу. \r\nДля місцевих жителів годування лебедів давно стало своєрідним святом. Зграя голубів носиться над пляжем, підбираючи крихти з піску, бігають собаки, діти радіють можливості погодувати лебедів і інших птахів майже з рук, метушлива боротьба за найкращі шматки у воді - веселе і яскраве видовище у міжсезоння.','2010-03-03 17:42:22','2010-03-03 17:42:22'),(52,34,'uk','Нічні вогні Судакської набережної.','Набережна вночі','Влітку вечір у Судаку завжди приносить із собою відчуття свята. І його центром звичайно є набережна. Вечірнє море, що відображає вогні кафе і катерів, прохолода, що прийшла на зміну денного дзвінкого зною, гарно одягнена гуляюча курортна публіка - все це манить і притягує. Але якщо Ви трохи втомилися від галасливих ресторанів і дискотек, то досить вийти до пляжу і вдихнути ковток свіжого морського бризу, і Ви відчуєте зовсім іншу ніч - ніч тихого шелестіння хвиль і загадкового нічного моря. Доріжки світла від місяця, берегових вогнів та ілюмінації катерів і теплоходів м\'яко стеляться по водній поверхні, яка ще встигає передати останні відблиски вечірнього неба. Якщо у вас буде можливість - обов\'язково спробуйте скупатися в морі вночі. Хоча повинен попередити що це заборонено - купатися вночі вважається небезпечним заняттям і, до того-ж, на ніч міські пляжі закриваються. І ще привід для занепокоєння - частенько нічні купальники не можуть знайти деяких своїх речей, необачно залишених на пляжі без нагляду. Але всі проблеми можна вирішити, і якщо вам все-таки вдасться скупатися в морі вночі, я впевнений, ви отримаєте незабутні враження.','2010-03-03 17:47:07','2010-03-03 17:47:07'),(53,11,'uk','Види з набережної Судака в ясну погоду.','Море та хмари','Великі обсяги води притягують людину. Морем багато людей можуть милуватися годинами, адже воно постійно змінюється. Іноді колір моря може здаватися \"неправильним\" - сірим, зеленим, коричневим і навіть бордовим. Це добре видно, адже завжди є еталон - блакитне небо. Білі хмари в ясну погоду додають в морські пейзажі легкості і різноманітності.','2010-03-03 17:49:42','2010-03-03 17:49:42'),(54,43,'uk','Чудове місце для дайверів.','Гравійна Бухта - дикий пляж','У гравійній бухті на мисі Меганом є чудовий маленький пляж з чистою водою, оточений з усіх сторін, окрім південної, високими скелями. Відпочинок тут підійде не всім, але якщо Ви любите проводити час на природі, це місце має всі шанси Вас зачарувати. Якщо ви любитель дайвінгу, то Гравійну бухту Вам пропустити не можна ніяк. Вона відома чистотою своєї води, майже унікальною для Чорного моря.','2010-03-03 17:53:45','2010-03-03 17:53:45'),(55,42,'uk','Пляж Судака взимку.','Зимовий пляж','Багатьох цікавить питання - чи замерзає море взимку? Чорне море в районі Судака не замерзає ніколи. Навіть якщо температура повітря опускається до двадцяти градусів морозу (буває й таке, правда досить рідко) і на землі лежить сніг, моря грає хвилями так-само як і в інші пори року. Тільки в смузі прибою на каменях або на палях пристаней можуть утворюватися крижані нарости. \r\nТемпература морської води взимку - близько 8 градусів, саме тому в прибережній зоні зима значно тепліше ніж, скажімо, навіть на 40 кілометрів вглиб півострова. Але з цієї ж причини весна на узбережжі зазвичай холодна і затяжна. Поки величезні маси води не прогріються променями весняного сонця, до тих пір важкі тумани будуть майже щодня накривати поля й долини між горами. Для тих, хто хоче приїхати в Судак на відпочинок саме навесні, варто врахувати цей момент. \r\nАле поки що йде зима. Безлюдні пляжі на холоді втратили свої літні яскраві фарби і змінили їх на м\'які авкварельні тони.','2010-03-03 17:57:57','2010-03-03 17:57:57'),(56,41,'uk','Зимовий пляж у штормову погоду.','Зимове море','Влітку шторм в районі Судака буває рідко. Море виплискує всі свої емоції в інші пори року. В основному - взимку. Взимку море стає зовсім іншим - холодним та суворим. Від літньої легкості і приємного шелесту прозорих хвиль не залишається і сліду. Темно-сіре, сталеве, брудно-зелене, чорне, коричневе - ось кольори моря зимового. Холодний пронизливий вітер жене на порожні пляжі темні хвилі, покриті клаптями білої піни. Хвиля кидається на берег, потім відступає, ненадовго залишаючи поступово зникаючу блискучу площину піску.','2010-03-03 18:01:26','2010-03-03 18:01:26'),(57,40,'uk','Популярні заміські пляжі.','Пляжі біля Морського','У селищі Морське, яке розташоване на березі моря на захід від Судака, є гарний великий пляж. Але якщо проїхати трохи далі в напрямку Алушти, то Ви побачите дві широкі бухти. Машину можна залишити на узбіччі або навіть з\'їхати вниз, на сам пляж. Тут можна поставити тент або палатку і зупинитися не кілька днів. На відміну від Судака, пляжі якого знаходяться в межах порівняно невеликої бухти, тут берег є більш відкритим. Гори не підходять дуже близько до води і можна повною мірою відчути морський простір.','2010-03-03 18:04:15','2010-03-03 18:04:15'),(58,39,'uk','Популярний заміський пляж та кемпінг.','Пляжі Капсельської долини','Самим доступним і, ймовірно, популярним кемпінгом Судака є Капсельські пляжі під мисом Меганом. Хоча тутешній ландшафт досить своєрідний і нагадує пустелю (насправді це і є солончакова пустеля), а пляжі впорядковані не повністю, це місце стало альтернативою часто переповненим міським пляжам Судака. На машині не важко буде проїхати кілька кілометрів уздовж моря, щоб потрапити сюди. До води можна під\'їхати, можна поставити намет і жити постійно. Пляжі тут різні - є піщані, гравійні і кам\'янисті, вибирайте на свій смак. З пляжу можна милуватися прекрасним видом на Новий Світ і на більш далеке узбережжі за ним - до самої Ведмідь-гори, що добре видно в ясну погоду.','2010-03-03 18:07:38','2010-03-03 18:07:38'),(59,33,'uk','Один з цілої мережі невеликих винних магазинів відомої торгової марки.','Магазин Вина Сонячної долини','Один з цілої мережі невеликих винних магазинів відомої торгової марки.','2010-03-03 18:11:16','2010-03-03 18:11:16'),(60,32,'uk','Автостоянка біля основної курортної зони Судака.','Автостоянка біля Кипарисової алеї','Платна автостоянка біля основної курортної зони Судака.','2010-03-03 18:13:17','2010-03-03 18:13:17'),(61,31,'uk','Міська пошта','Відділення пошти та зв\'язку Укртелеком','Відділення Укртелекому надає всі основні профільні послуги.','2010-03-03 18:15:30','2010-03-03 18:15:30'),(62,30,'uk','Кінотеатр Чайка розташований практично в центрі Судака.','Кінотеатр Чайка','Кінотеатр Чайка розташований практично в центрі Судака.','2010-03-03 18:17:14','2010-03-03 18:17:14'),(63,29,'uk','Сучасна аптека на центральній вулиці Судака.','Аптека Мед-Сервіс','Сучасна аптека на центральній вулиці Судака.','2010-03-03 18:19:09','2010-03-03 18:19:09'),(64,28,'uk','Один з найбільших готелів Судака.','Готель Форум','При готелі є ресторан, бар, фітнес-центр.','2010-03-03 18:25:38','2010-03-03 18:25:38'),(65,27,'uk','Один з найстаріших готелів Судака.','Готель Сурож','Зручно розташована готініца із затишним ландшафтним двориком.','2010-03-03 18:27:31','2010-03-03 18:27:31'),(66,26,'uk','Готель на розі вулиці Леніна і Кипарисовий алеї.','Готель Royal','Готель з невеликим торговим центром на першому поверсі.','2010-03-03 18:58:45','2010-03-03 18:58:45'),(67,25,'uk','Їдальня на центральній вулиці Судака','Їдальня № 1','Їдальня пропонує недороге меню а також піцу.','2010-03-03 19:00:52','2010-03-03 19:00:52'),(68,24,'uk','Затишне кафе на розі однієї з найбільш популярних у приїжджих вулиці - Спендіарова.','Кафе на розі вулиць Леніна і Спендіарова','Затишне кафе на розі однієї з найбільш популярних у приїжджих вулиці - Спендіарова.','2010-03-03 19:02:12','2010-03-03 19:02:12'),(69,23,'uk','Магазин продуктів на центральниой вулиці Леніна.','Міні-маркет Юг','Зручно розташований магазин продуктів.','2010-03-03 19:04:31','2010-03-03 19:04:31'),(70,22,'uk','Невеликий магазин на центральній вулиці Леніна.','Магазин продуктів','Магазин знаходиться на шляху з центру Судака і більш далеких районів до центрального пляжу.','2010-03-03 19:06:12','2010-03-03 19:06:12'),(71,21,'uk','Зручно розташований магазин.','Магазин продуктів на розі вулиць Леніна і Спендіарова','У магазині представлено широкий вибір продуктів.','2010-03-03 19:08:03','2010-03-03 19:08:03'),(72,20,'uk','Відділення відомого в Україні банку','Відділення Приватбанку','Відділення Приватбанку розташоване біля готелю Форум.','2010-03-03 19:11:41','2010-03-03 19:11:41'),(73,19,'uk','Відділення банку Петрокоммерц','Судацьке відділення банку Петрокоммерц','Відділення банку Петрокомерц розташоване практично в центрі міста.','2010-03-03 19:13:45','2010-03-03 19:13:45'),(74,18,'uk','У цьому невеликому, але зручно розташованому відділенні, Ви можете скористатися всіма основними послугами відомого банку.','Міні-відділення Приватбанку','У цьому невеликому, але зручно розташованому відділенні, Ви можете скористатися всіма основними послугами відомого банку.','2010-03-03 19:15:57','2010-03-03 19:15:57'),(75,16,'uk','Недороге житло, затишний двір. До пляжу менше 700 метрів.','Недорогий відпочинок на вулиці Прикордонників','Знайти недороге і зручне місце для відпочинку в Судаку цілком реально. Гостинні господарі пропонують двох, трьох і чотиримісні номери з травня по жовтень. Дзвоніть (телефони в Україні): Київстар +380 98-101-21-52, Лайф +380 93-575-26-41.','2010-03-03 19:18:11','2010-04-23 19:47:38'),(76,17,'uk','Недороге житло, затишний двір.','Недорогі номери, до пляжу - 700 метрів','Знайти недороге і зручне місце для відпочинку в Судаку цілком реально. Гостинні господарі пропонують двох, трьох і чотиримісні номери з травня по жовтень. Дзвоніть (телефони в Україні): Київстар +380 98-101-21-52, Лайф +380 93-575-26-41.','2010-03-03 19:19:59','2010-04-23 19:48:27'),(77,15,'en','A walk in the mountains for Morskoye.','Mountains in November','Crimean mountains are beautiful in any season. Of course, always in his own way. Summer ringing heat, spring fogs or winter pure freshness in the picturesque compete with melancholy of autumn. \r\nDestination - the mountain village near the Morskoye. We go on the South road from Morskoye to Yalta. Turn right - at Zelenogorye. We drive a few kilometers along the valley with a few vineyards by a narrow asphalt. \r\nBelow are only visible to the nearest hills and peaks of distant mountains.  We can easily climb up. Mountain low and fairly flat. From above we can see the tops of higher mountains to the north.','2010-03-05 08:34:20','2010-03-05 08:34:20'),(78,14,'en','Road to Sun Valley through fields of grapes.','Autumn Vineyards','Passing the autumn grape fields, you can see carpets saturated pastel shades, which can change its color virtually every bend in the road. Different varieties of grapes paint their no longer needed leaves by yellow and shades of green and red-purple color  before the winter. It giving a lot of food for thought for artists.  Wine brand \"Solar Valley\" is made from grapes from these fields.','2010-03-05 08:41:25','2010-03-05 08:41:25'),(79,13,'en','Walking near Sun Valley.','Near Sun Valley','Sun Valley is a small village, situated in the very picturesque place. In the north it is surrounded by mountains, which are characteristic of rocky ridge. The distance to the sea is about one kilometer. To get out of Sudak in Sun Valley, you have two ways: Sudak-Feodosia highway or road through the Kapselskuyu valley and Bogatovku. This road is more interesting for those who want to see a variety of local scenery and landscapes. The road above Sun Valley turns to Theodosia. The path that circles the Cape Meganom, winding hills and vineyards can leave you enough thrills. Hiking the surrounding hills will add brightness to these impressions.','2010-03-05 08:51:57','2010-03-05 08:51:57'),(80,12,'en','Views from the hills to the north of Cape Meganom.','Near Bugaz Lake ','You can get off the road from Bogatovki in Sun Valley and walk through the beautiful hills covered with sparse pine forest. Eastern Crimea and Sudak has a great variety of species and landscapes. All the shots are taken almost from one place. Often, in order to get from beach to mountain trails or in the dense forest rather a twenty-walking. If you have a car or a boat features become larger and more diverse.','2010-03-05 08:59:46','2010-03-05 08:59:46'),(81,10,'en','A popular place of \"wild\" holiday in the offseason.','Bay near the Morske','Local residents often hear from visitors in the summer: - Do you have winter here at all? These people have seen only in the Crimea during June-August. They are difficult to imagine that the bustling resort anthill in fact it is a smaller part of local life. Beaches, which are entirely covered by bodies of sunbathers, umbrellas, canopies, tents and vehicles in the off-season take the form of almost pristine purity. Winter storms and the rains washed all traces of human joys and concerns. Bay to the west of the Morske are deservedly popular with holidaymakers that\'s just prefer to relax with tents and cars only. The road from Sudak to Big Yalta is near the coast of the sea. Later, it goes up and down by countless turnings of mountain asphalt ribbon.','2010-03-05 09:15:21','2010-04-05 18:21:16'),(82,9,'en','Boat trip in the Gravel Bay.','Gravel Bay','In this place near Sudak much more interesting to travel by sea. Gravel Bay is located on Cape Meganom. Landing on a small boat is to dock in a rescue station near the central beach. When smaller the size of swimming facilities  then it shakes more. Even if the type of the sea is calm, you still may get sea sickness. Prior gravel bay get a couple of tens of minutes, and the positive emotions of the trip will overlap the small inconvenience. While the rest is difficult business, but it is a separate issue. Landing is right on the coastal cliffs. You find yourself in a cozy pebble bay, which above rise the steep cliffs of the Meganom. Gravel Bay is known primarily clean water and beautiful views of the coast to the west of Sudak. If the view of the sea at the beaches of Sudak does not cause you a great inspiration you can go in the Gravel Bay.','2010-03-05 09:29:48','2010-03-05 09:29:48'),(83,8,'en','View of the coast from the slope of Cape Meganom.','Climbing Meganom','In Crimea there are many pleasant and useful things. The most important is, of course, the sea. It captivates, charms, leads back to itself again and again. The sea has a lot of faces. His image appears from top as from some mountain also others. The reason is that the light is reflected from the water and that greatly expanded view too and other unimportant moments. Sea attracts.','2010-03-05 09:42:06','2010-03-05 13:21:39'),(84,7,'en','What can be seen on top of one of the most beautiful mountains of Sudak?','At the top of Mount Falcon','Not all people understand and enjoy hiking in the mountains. Why does they need to climb to a certain elevation on the slopes of crumbling in the heat of 35 degrees? A clever man naturally bypass this mountain . I think is most important here what is to look at. Watch is not under your feet (and sometimes feet must of course), not only for friend but we need to look around. Around in the broadest sense of this word. Then it becomes clear that just below us, beneath our feet, is Planet. Respect for Grishkovets, all rights reserved.','2010-03-05 13:36:17','2010-03-05 13:36:17'),(85,6,'en','Vineyards in autumn.','Fields near the Morske','Autumn in Crimea is being complacent. Everything becomes relaxed and meditative but still quite warm. Missing summer contrasts and reflections, blinding your eyes, and irrepressible crack cicadas. Summer fatigue from the heat goes away. Sea, mountains, hills and all around suddenly loses brightness. Infrequent patches of bright colors suddenly tearing this tarnish with latest outbreaks. Soon there will come almost entirely colorless winter months.','2010-03-05 13:49:16','2010-04-05 18:22:25'),(86,5,'en','Views from the summit of Falcon Mount .','On Falcon Mount ','Mount Falcon is visible from almost all points of Sudak. A memorable image of the mountain attracts large number of people who want to conquer its summit. Make it simple. There are two main routes. The first path is the rise near of rock Thunderbolt from east side of mountain. It can be recommended only for people prepared. The second path is the rise by the trail from the New World. This way we can safely absorb to any healthy person. You can conquer the Falcon in the tour with an experienced guide who will tell a lot of interesting things. If you go alone you will not regret it too. You can go at any pace you want and to dispose freely of your own time. The height of the Falcon is more than four hundred meters. From the sea mountain has an almost sheer wall. Mountain climbers often test their strength on this wall.','2010-03-05 14:06:20','2010-03-05 14:06:20'),(87,4,'en','Walk near Mount Perchem.','Mountains near Sudak','Sudak has many advantages as a place to rest for active people and people who are interested in nature. There is a lot of interesting routes which are located not far from the city. The surrounding mountains can provide many experiences for all people who spend some energy and its time for them. Mountains Perchem and Sokol attract tourists with its size and appearance. The breathtaking view opens from the tops of these mountains. Walking through their many confusing paths present to your attention very interesting and breathtaking views of the Crimean nature.','2010-03-05 15:33:54','2010-03-05 15:33:54'),(88,3,'en','The descent to the sea from the road to the New World.','The path to the wild beach','The road from Sudak to the New World goes around the steep mountain slopes. This road is interesting and picturesque. Filmmakers made a lot of movies and music videos at this point. But now we leave the car in one of the pockets and go down to the sea. We can see almost sheer wall of mountain Sokol. It was a living old times coral rifv. Therefore, the mountain has a peculiar shape. Area under the Falcon up to the New World declared as botanical reserve. The air here is really special, it has a pleasant smell of juniper and some other plants. The path descends to the wild rocky beach.There are sandy areas some places on the coast. This beach is quite popular with nudists.','2010-03-05 18:39:55','2010-03-05 18:39:55'),(89,35,'en','The winter feeding of swans and other marine birds.','The Seabirds','Swans sometimes remain for the winter in Sudak. The entire flock swim to shore in a hard cold. People give them bread and birds eagerly rush for food, creating a crush and selecting each other prey. In addition to swans, active participants in the division are the gulls. They have more speed and maneuverability, as well as great arrogance. They often draw their pieces of bread from under the beak of imposing swans. Here and there glimpses the black plunges. They are much smaller than the swans and less modest than the gulls, so pick something that did not see other birds. But some days so many people wanted to feed the birds that fed swans ignoring food and will leave a little further from shore. \r\nFor local people feeding swans had been a holiday. A flock of pigeons is worn over the beach and the birds pick up the crumbs from the sand. Dogs run around, children are happy for opportunity to feed the swans and other birds. Birds fight for the best pieces of food. This are cheerful and bright scenes in the offseason.','2010-03-05 19:15:59','2010-03-05 19:15:59'),(90,34,'en','Night lights of Sudak embankment.','Quay at night','Summer evening in Sudak always brings a nice atmosphere. Its center is the embankment. Evening sea reflected the lights of cafes and boats. The coolness comes to replace the ringing daytime heat. People walks along the shore and all it attracts and draws. If you are a bit tired by the busy restaurants and discos you can go to the beach and breathe the fresh sea breeze. You will feel a different night. The night of the quiet rustle of the waves and the night of mysterious night sea. Moon Path, shore lights and illumination of boats and ships gently reflected from the water surface. Water still passes the last gleams of the evening sky. If you have such an opportunity you must swim in the sea at night. Only you keep in mind that it is forbidden to do. Night swimming is considered dangerous and occupation and beaches are closed at night. Night bathers could not find some of their things that they sometimes rashly left on the beach unattended. But all problems can be solved. If you swim in the sea at night, I\'m sure you will get an unforgettable experience.','2010-03-06 09:07:42','2010-03-06 09:07:42'),(91,11,'en','Species from the embankment of Sudak in clear weather.','The sea and the clouds','Large volumes of water attract people. Many people can admire the sea for hours, because it is constantly changing. Sometimes the color of the sea may seem \"wrong\". It may be gray, green, brown but even burgundy.  You can see it very well, because there is always as a benchmark as the blue sky. White clouds in clear weather add to the seascapes lightness and diversity.','2010-03-06 09:20:04','2010-03-06 09:20:04'),(92,43,'en','This is a great place for divers.','Wild beach in the Gravel Bay ','There is a beautiful little beach with the cleanest water in the Gravel Bay. It is surrounded by high cliffs and holidays are not fit for all there. If you like spending time outdoors, this place will fascinate you. You can not miss the Gravel Bay if you are fan of diving. This bay is famous by clean water and its purity is almost unique for the Black Sea.','2010-03-06 10:46:08','2010-03-06 10:46:08'),(93,42,'en','The beach of Sudak in the winter.','Winter beach','People often ask - whether the sea freezes in winter? Black Sea does not freeze in the area of Sudak. Even if the air temperature drops to twenty degrees below zero (sometimes it happens, though rarely) and on the ground is snow, the sea has waves, so the same as in other seasons. Only the build-up of ice formed in a strip of surf on the rocks or jetties on piles. \r\nThe temperature of sea water in the winter - about 8 degrees. Therefore, in the coastal zone the winter is much warmer than in, say, even up to 40 kilometers deep into the peninsula. But for this same reason, the spring on the coast is usually more cold and protracted. While the vast mass of water has warmed by spring sun, until the damp mist  will lay the fields and valleys between the mountains. It should take attention of this moment for those who want to come to rest in Sudak in the spring. \r\nBut while attending the winter. Empty beaches have lost their summer bright colors and changed them to watercolor\'s  soft tone.','2010-03-10 17:40:35','2010-03-10 17:40:35'),(94,41,'en','Winter beach in stormy weather.','Winter Sea','Summer storm is rare near Sudak. The sea throws all their emotions in other seasons. Basically - in the winter. Winter the sea is quite different, it becomes cold and harsh. No trace remains of the summer easy and pleasant rustle transparent waves. Dark-gray, steel, dirty green, black, brown is the color of the sea of winter. Cold and piercing wind chases the dark waves on the empty beaches, playing with tufts of white foam. The wave strikes the shore, then recedes, leaving briefly disappearing brilliant plane of sand. \r\n      ','2010-03-10 17:52:20','2010-03-10 17:52:20'),(95,40,'en','Popular suburban beaches.','Beaches near the Morske','Morske Village is located on the coast to the west of Sudak. Here is a nice big beach. But if you drive a little farther in the direction of Alushta, you will see two large bays. You can left the car on the sidelines or even go  down on the beach. Here you can put an awning or a tent and stay for a few days. Unlike Sudak, beaches which are within a relatively small bay, the shore here is more open.','2010-03-10 18:05:49','2010-04-05 18:18:22'),(96,39,'en','Popular suburban beach and camping.','Beaches of Kapsel Valley','The most accessible and popular camping of Sudak is Kapsel beaches at Cape Meganom. The local landscape is quite unique and reminds the desert (in fact it is the saline desert), but has not fully landscaped beaches, this place has become an alternative to overcrowded city beachs of Sudak. Reaching here is easy. You can put a tent here and live for a long time. The beaches here are different - sand, gravel and stone, you can choose to your taste. From this point you can admire the stunning views of the New World and on the coast behind him - until Bear Mountain, which is visible well in clear weather.','2010-03-10 18:15:25','2010-03-10 18:15:25'),(97,33,'en','This is one of many small wine shops of famous brand.','Sun Valley trademark\'s Wine Shop','This is one of many small wine shops of famous brand.','2010-03-10 18:21:06','2010-03-10 18:21:06'),(98,32,'en','Parking near the main resort zone of Sudak.','Parking near Kiparisova alley','Paid parking near the waterfront of Sudak.','2010-03-10 18:23:32','2010-03-10 18:23:32'),(99,31,'en','City Post Office','Department of Post and Telecommunications Ukrtelecom','Ukrtelecom office  provides all the basic profile service.','2010-03-10 18:26:03','2010-03-10 18:26:03'),(100,30,'en','Cinema Seagull located in the center of Sudak.','Cinema Seagull','Cinema Seagull located in the center of Sudak.','2010-03-10 18:27:50','2010-03-10 18:27:50'),(101,29,'en','Modern pharmacy on the main street of Sudak.','Med-Service pharmacy','Modern pharmacy on the main street of Sudak.','2010-03-10 18:32:26','2010-03-10 18:32:26'),(102,28,'en','One of the biggest hotels in Sudak.','Hotel Forum','The hotel has a restaurant, bar, fitness center.','2010-03-10 18:35:17','2010-03-10 18:35:17'),(103,27,'en','One of the oldest hotels of Sudak.','Hotel Surozh','Conveniently located hotel with a cozy courtyard landscape.','2010-03-10 18:42:48','2010-03-10 18:42:48'),(104,26,'en','Hotel on the corner of Lenin street and cypress avenue.','Hotel Royal','Hotel with a small shopping center.','2010-03-10 18:45:46','2010-03-10 18:45:46'),(105,25,'en','Dining on the main street of Sudak.','Dining Room № 1','Dining offers an inexpensive menu and pizza.','2010-03-10 18:48:06','2010-03-10 18:48:06'),(106,24,'en','Cozy cafe on the corner of one of the most popular for visitors Spendiarova street.','Cafe on the corner of Lenin and Spendiarova','Cozy cafe on the corner of one of the most popular for visitors Spendiarova street.','2010-03-10 18:51:36','2010-03-10 18:51:36'),(107,23,'en','Grocery store on Lenin Street.','Mini-market South','Conveniently located grocery store.','2010-03-10 19:00:36','2010-03-10 19:00:36'),(108,22,'en','A small shop on the main Lenin street.','Grocery store','The store is on the way from the center of Sudak to the central beach.','2010-03-11 08:30:38','2010-03-11 08:30:38'),(109,21,'en','Conveniently located store.','Grocery store on the corner of Lenin and Spendiarova','The store presents a wide choice of products.','2010-03-11 08:32:52','2010-03-11 08:32:52'),(110,20,'en','Branch of known in Ukraine bank. ','Department of Privatbank','Branch of Privatbank located near the Hotel Forum.','2010-03-11 08:35:47','2010-03-11 08:35:47'),(111,19,'en','Petrocommerce Bank branch is located near the center of the city.','Branch of Bank Petrocommerce','Petrocommerce Bank branch is located near the center of the city.','2010-03-11 08:38:28','2010-03-11 08:38:28'),(112,18,'en','In this conveniently located small office you can get all the basic services of well-known bank.','Mini Branch of Privatbank','In this conveniently located small office you can get all the basic services of well-known bank.','2010-03-11 08:41:59','2010-03-11 08:41:59'),(113,17,'en','Affordable housing, a cozy courtyard.','Cheap rooms, 700 meters to the beach','To find a cheap and convenient place to rest in Sudak is quite real. Hospitable hosts offer two, three and four-bed rooms for you from May to October.','2010-03-11 08:46:05','2010-03-11 08:46:05'),(114,16,'en','Affordable housing, a cozy courtyard. The distance to the beach is less than 700 meters.','Inexpensive holiday in the Pogranichnikov street','To find a cheap and convenient place to rest in Sudak is quite real. We can offer for you two, three and four-bed rooms from May to October.','2010-03-11 08:52:25','2010-03-11 08:52:25'),(115,44,'ru','Свежие краски весеннего Крыма','Судак в конце апреля','Весна в приморских районах Крыма это время неустойчивости и неуверенности. Только что дул пронизывающий северный ветер а через полчаса солнце берёт реванш и заставляет снимать порядком надоевшую за зиму верхнюю одежду. Холодные туманы с моря постепенно уступают место теплу приближающегося лета. Окружающие Судак горы и холмы покрываются изысканными в своей скромности крымскими цветами.   ','2010-04-26 19:07:07','2010-04-26 19:38:59');
