INSERT INTO `articles` VALUES ('tag_wild_beach,tag_wild_beach,tag_Sokhol',15,3,2,10,'Тропинка на дикий пляж','Спуск с дороги на Новый Свет к морю. ','Дорога из Судака в Новый Свет, которая многочисленными поворотами огибает крутые горные склоны, сама по себе интересна и живописна. Тут снято огромное количество фильмов и музыкальных клипов. Но сейчас мы оставим машину в одном из \"карманов\" и спустимся вниз, к морю. С тропы можно снизу рассмотреть почти отвесную стену горы Сокол. Считается что в давние времена это был живой коралловый риф, именно поэтому гора имеет такую специфическую форму. Территория под Соколом до самого Нового Света объявлена ботаническим заказником. Воздух тут действительно особенный, имеет приятный запах можжевельника и каких-то других растений. Тропинка спускается на каменистый дикий пляж. Лишь местами на берегу есть песчаные участки. Людей сдесь немного, но учтите что это место довольно популярно у нудистов.  ',1,'2009-11-24 09:42:07','2009-11-24 09:42:07','2010-04-05 17:46:39','2010-04-05 17:46:39',0),('tag_mountains,tag_Sokhol,tag_bastion_mountain,tag_Perchem',14,4,2,10,'Горы возле Судака','Прогулка недалеко от горы Перчем.','Одним из многих преимуществ Судака как места для отдыха людей активных и интересующихся природой является наличие большого количества интереснейших маршрутов совсем недалеко от города. Окружающие Судак горы, несмотря на свою небольшую высоту, могут дать любому, кто потратит на них немного сил и времени, большое количество впечатлений. На востоке от Судака привлекают своими размерами и видом горы Перчем и Сокол. И хотя принято считать что именно с вершин гор открывается самый захватывающий вид, прогулка многочисленными запутанными тропинками возле их подножий способна представить Вашему вниманию не меньше интересных и, подчас захватывающих, видов крымской природы.       ',1,'2009-11-26 12:17:19','2009-11-24 09:42:07','2010-04-07 15:31:45','2010-04-07 15:31:45',0),('tag_mountains,tag_Sokhol',13,5,2,10,'На горе Сокол','Виды с вершины горы Сокол.','Гора Сокол видна почти из всех точек Судака. Запоминающийся образ горы притягивает к себе большое количество желающих покорить ее вершину. Сделать это несложно. Существует два основных маршрута. Первый - подъем возле скалы Чертов Палец со стороны Судака - можно рекомендовать только людям подготовленным. Второй - подъем по тропе от Нового Света - можно смело осваивать любому здоровому человеку. Из Судака можно покорять Сокол в составе экскурсии с опытным проводником, который  расскажет много интересного. Те, кто решил положиться только на себя, тоже не пожалеют - они смогут идти в любом желаемом для них темпе и свободно распоряжаться своим временем. Высота Сокола более четырехсот метров. Со стороны моря гора имеет почти отвесную стену, на которой часто пробуют свои силы альпинисты. ',1,'2009-11-26 12:26:05','2009-11-24 09:42:07','2010-04-05 17:45:17','2010-04-05 17:45:17',0),('tag_grapes,tag_vineyard,tag_Morskoe',12,6,2,10,'Fields near the Morske','Vineyards in autumn.','Autumn in Crimea is being complacent. Everything becomes relaxed and meditative but still quite warm. Missing summer contrasts and reflections, blinding your eyes, and irrepressible crack cicadas. Summer fatigue from the heat goes away. Sea, mountains, hills and all around suddenly loses brightness. Infrequent patches of bright colors suddenly tearing this tarnish with latest outbreaks. Soon there will come almost entirely colorless winter months.',1,'2009-11-26 12:37:13','2009-11-24 09:42:07','2010-04-05 18:22:25','2010-04-05 18:22:25',0),('tag_mountains,tag_Sokhol',11,7,2,10,'На вершине горы Сокол','Что можно увидеть на вершине одной из красивейших гор Судака?','Не все люди понимают и любят походы в горы. Ради чего нужно на жаре в 35 градусов по осыпающимся склонам лезть на какое-то возвышение, которое умный человек конечно-же обойдет? Мне кажется, самое важное тут - это на что смотреть. Смотреть нужно не под ноги (ну иногда и под ноги конечно надо), не только на спутника или спутницу,  а вокруг. Вокруг - в самом широком смысле этого слова. Тогда становится понятно, что прямо под нами, под вот этими ногами - Планета. Гришковцу - респект, копирайт соблюден.   ',1,'2009-11-26 12:43:13','2009-11-24 09:42:07','2010-04-05 17:44:07','2010-04-05 17:44:07',0),('tag_mountains,tag_seashore,tag_Meganom',10,8,2,10,'Поднимаясь на Меганом','Вид на побережье со склона мыса Меганом.','Много в Крыму приятностей и полезностей, но самым важным, тем, ради чего, собственно, все и едут сюда является, конечно, море. Оно покоряет, завораживает, заставляет возвращаться к себе снова и снова. Море имеет много образов, и его образ при виде сверху, с какой-нибудь горы, тоже другой. Причины этого, конечно, и в том что свет в этом случае по другому отражается от воды, и в том, что существенно расширяется панорама, и прочие, в общем, неважные моменты. Море притягивает. ',1,'2009-11-26 12:48:05','2009-11-24 09:42:07','2010-04-05 17:43:36','2010-04-05 17:43:36',0),('tag_shore,tag_beach,tag_Meganom,tag_bay_gravel,tag_wild_beach',9,9,2,10,'Гравийная бухта ','Поездка катером в Гравийную бухту. ','Одним из мест поблизости Судака, куда интереснее добираться морем, является бухта Гравийная на мысе Меганом. Посадка на маленький катер происходит на причале спасательной станции недалеко от центрального пляжа. Учтите, что чем меньше размеры плавательного средства, тем сильнее его качает. И даже если на вид море достаточно на Ваш взгляд спокойное, то не факт что никто не пострадает от морской болезни. Но до Гравийной бухты добираться всего пару десятков минут, так что положительные эмоции от поездки с лихвой перекроют маленькие неудобства. Хотя отдых - дело само по себе достаточно нелегкое, но это отдельная тема. Высадка происходит прямо на прибрежные скалы. Вы попадаете в уютную галечную бухту, над которой крутым склоном поднимаются скалы самого Меганома.  Гравийная бухта известна главным образом чистотой воды и красивым видом на побережье к западу от Судака. Если вид моря на городском пляже не вызывает у Вас большого желания в него нырнуть, съездите в Гравийную. ',1,'2009-11-26 13:06:17','2009-11-24 09:42:07','2010-04-05 17:43:03','2010-04-05 17:43:03',0),('tag_shore,tag_Morskoe,tag_beach,tag_camping',8,10,2,10,'Bay near the Morske','A popular place of \"wild\" holiday in the offseason.','Local residents often hear from visitors in the summer: - Do you have winter here at all? These people have seen only in the Crimea during June-August. They are difficult to imagine that the bustling resort anthill in fact it is a smaller part of local life. Beaches, which are entirely covered by bodies of sunbathers, umbrellas, canopies, tents and vehicles in the off-season take the form of almost pristine purity. Winter storms and the rains washed all traces of human joys and concerns. Bay to the west of the Morske are deservedly popular with holidaymakers that\'s just prefer to relax with tents and cars only. The road from Sudak to Big Yalta is near the coast of the sea. Later, it goes up and down by countless turnings of mountain asphalt ribbon.',1,'2009-11-26 13:11:29','2009-11-24 09:42:07','2010-04-05 18:21:16','2010-04-05 18:21:16',0),('tag_seashore,tag_sea',16,11,2,15,'Море и облака','Виды с набережной Судака в ясную погоду.','Большие объемы воды притягивают человека. Морем многие люди могут любоваться часами, ведь оно постоянно меняется. Иногда цвет моря может казаться \"неправильным\" - серым, зеленым, коричневым и даже бордовым. Это хорошо видно, ведь всегда есть эталон - голубое небо. Белые облака в ясную погоду добавляют в морские пейзажи легкости и разнообразия.',1,'2009-11-26 13:17:31','2009-11-24 09:42:07','2010-04-07 15:30:20','2010-04-07 15:30:20',0),('tag_mountains,tag_Sun_Valley,tag_lake,tag_Bugaz',17,12,2,10,'Возле озера Бугаз','Виды с холмов к северу от мыса Меганом.','Если сойти с дороги из Богатовки в Солнечную Долину и пройтись по красивым холмам, поросших редким сосновым лесом, можно убедится в том, что Восточный Крым и окрестности Судака в том числе, отличается большим разнообразием видов и ландшафтов. Все представленные снимки сделаны практически из одного места. Часто для того чтобы сменить, например, пляж на горные тропы, или густой лес на солончаковую пустыню, достаточно двадцатиминутной пешей прогулки. При наличии машины или катера возможности становятся еще большими.    ',1,'2009-11-26 13:22:26','2009-11-24 09:42:07','2010-04-05 17:19:50','2010-04-05 17:19:50',0),('tag_mountains,tag_Sun_Valley,tag_Meganom',18,13,2,10,'Возле Солнечной Долины','Прогулка недалеко от Солнечной Долины.','Солнечная Долина - небольшой поселок, расположенный в довольно живописном месте. С севера его окружают горы, многие из которых имеют характерный скалистый гребень, до моря расстояние составляет около одного километра. Добраться из Судака в Солнечную Долину можно двумя путями - трассой Судак-Феодосия или дорогой, пролегающей через Капсельскую долину и Богатовку. Эта дорога обычно более интересна для тех, кто хочет увидеть различные местные пейзажи и ландшафты. И хоть, в конечном итоге, и эта дорога выше Солнечной Долины поворачивает на феодосийскую, путь, огибающий мыс Меганом и петляющий холмами и виноградниками может оставить у Вас достаточно яркие впечатления. Пешие-же прогулки окрестными холмами обязательно добавят яркости этим впечатлениям.',1,'2009-11-26 13:29:28','2009-11-24 09:42:07','2010-04-05 17:19:11','2010-04-05 17:19:11',0),('tag_grapes,tag_vineyard,tag_autumn',19,14,2,10,'Осенние виноградники','Дорога на Солнечную долину через поля винограда.','Проезжая осенью виноградными полями, можно наблюдать ковры насыщенных пастельных оттенков, которые могут менять свой цвет буквально с каждым поворотом дороги. Различные сорта винограда перед зимой окрашивают свои, уже не нужные, листья тонами желто-зелено-красно-бордовых красок, давая множество пищи для размышлений художникам, а остальным возможность просто любоваться. Из винограда именно с этих полей делается вино торговой марки \"Солнечная Долина\". ',1,'2009-11-26 13:35:05','2009-11-24 09:42:07','2010-04-05 17:11:52','2010-04-05 17:11:52',0),('tag_mountains,tag_Morskoe,tag_autumn',20,15,2,10,'Горы в ноябре','Поход в горы за Морское осенью.','Крымские горы красивы в любое время года. Конечно, всегда по своему. Летний звенящий зной, весенние туманы или зимняя чистая свежесть соревнуются в живописности с меланхолией осени.\r\nМесто назначения - горы возле поселка Морское. Едем по Южной дороге от Морского по напрвлению к Ялте. Сворачиваем направо - на Зеленогорье. По узкому асфальту проезжаем еще несколько километров по долине с редкими виноградниками. \r\nСнизу видны только ближайшие холмы и вершины далеких гор. Подняться наверх несложно, горы невысокие и достаточно пологие. Там, наверху, открывается вид на вершины более высоких гор к северу.  ',1,'2009-11-26 13:40:23','2009-11-24 09:42:07','2010-04-05 17:11:06','2010-04-05 17:11:06',0),('tag_inexpensive_holiday,tag_Pogranichnikov,tag_rental_housing',21,16,2,11,'Недорогий відпочинок на вулиці Прикордонників','Недороге житло, затишний двір. До пляжу менше 700 метрів.','Знайти недороге і зручне місце для відпочинку в Судаку цілком реально. Гостинні господарі пропонують двох, трьох і чотиримісні номери з травня по жовтень. Дзвоніть (телефони в Україні): Київстар +380 98-101-21-52, Лайф +380 93-575-26-41.',1,'2009-11-28 19:28:06','2009-11-24 09:42:07','2010-04-23 19:47:38','2010-04-23 19:47:38',0),('tag_inexpensive_holiday,tag_Pogranichnikov,tag_rental_housing',22,17,2,11,'Недорогі номери, до пляжу - 700 метрів','Недороге житло, затишний двір.','Знайти недороге і зручне місце для відпочинку в Судаку цілком реально. Гостинні господарі пропонують двох, трьох і чотиримісні номери з травня по жовтень. Дзвоніть (телефони в Україні): Київстар +380 98-101-21-52, Лайф +380 93-575-26-41.',1,'2009-11-28 19:49:50','2009-11-24 09:42:07','2010-04-23 19:48:27','2010-04-23 19:48:27',0),('tag_bank,tag_privatbank',23,18,2,3,'Мини-отделение Приватбанка','В этом небольшом, но удобно расположенном отделении, Вы можете воспользоваться всеми основными услугами известного банка.','В этом небольшом, но удобно расположенном отделении, Вы можете воспользоваться всеми основными услугами известного банка.',1,'2009-11-29 18:23:39','2009-11-24 09:42:07','2010-04-05 17:09:10','2010-04-05 17:09:10',0),('tag_bank,tag_petrocommerc',24,19,2,3,'Судакское отделение банка Петрокоммерц','Отделение банка Петрокоммерц','Отделение банка Петрокоммерц расположено практически в центре города.',1,'2009-11-29 18:28:43','2009-11-24 09:42:07','2010-04-05 17:08:39','2010-04-05 17:08:39',0),('tag_bank,tag_privatbank',25,20,2,3,'Отделение Приватбанка','Отделение известного в Украине банка','Отделение Приватбанка расположено возле гостиницы Форум.',1,'2009-11-29 18:32:53','2009-11-24 09:42:07','2010-04-05 17:06:37','2010-04-05 17:06:37',0),('tag_grocery_store,tag_mini_market,tag_food',26,21,2,6,'Магазин продуктов на углу улиц Ленина и Спендиарова','Удобно расположенный магазин.','В магазине представлен широкий выбор продуктов. ',1,'2009-11-29 18:39:07','2009-11-24 09:42:07','2010-04-07 15:34:20','2010-04-07 15:34:20',0),('tag_grocery_store,tag_mini_market,tag_food',27,22,2,6,'Магазин продуктов','Небольшой магазин на центральной улице Ленина.','Магазин находится на пути из центра Судака и более дальних районов к центральному пляжу.',1,'2009-11-29 18:43:44','2009-11-24 09:42:07','2010-04-05 17:05:55','2010-04-05 17:05:55',0),('tag_grocery_store,tag_mini_market,tag_food',28,23,2,6,'Мини-маркет Юг','Магазин продуктов на центральныой улице Ленина.','Удобно расположенный магазин продуктов.',1,'2009-11-29 18:48:06','2009-11-24 09:42:07','2010-04-05 17:05:15','2010-04-05 17:05:15',0),('tag_cafe,tag_food',29,24,2,5,'Кафе на углу улиц Ленина и Спендиарова','Уютное кафе на углу одной из наиболее популярных у приезжих улицы - Спендиарова.','Уютное кафе на углу одной из наиболее популярных у приезжих улицы - Спендиарова.',1,'2009-11-29 18:53:07','2009-11-24 09:42:07','2010-04-05 17:04:26','2010-04-05 17:04:26',0),('tag_dining_room,tag_cafe,tag_food',30,25,2,5,'Столовая №1','Столовая на центральной улице Судака.','Столовая предлагает недорогое меню а также пиццу.',1,'2009-11-29 18:58:11','2009-11-24 09:42:07','2010-04-05 17:03:51','2010-04-05 17:03:51',0),('tag_hotel,tag_royal',31,26,2,4,'Гостиница Royal','Гостиница на углу улиц Ленина и Кипарисовой аллеи.','Гостиница с небольшим торговым центром.',1,'2009-11-29 19:03:38','2009-11-24 09:42:07','2010-04-05 17:03:14','2010-04-05 17:03:14',0),('tag_hotel,tag_suroj',32,27,2,4,'Гостиница Сурож','Одна из старейших гостиниц Судака.','Удобно расположенная гостиница с уютным ландшафтным двориком.',1,'2009-11-29 19:08:07','2009-11-24 09:42:07','2010-04-05 17:02:40','2010-04-05 17:02:40',0),('tag_hotel,tag_forum',33,28,2,4,'Гостиница Форум','Одна из крупнейших гостиниц Судака. ','При гостинице есть ресторан, бар, фитнесс-центр.',1,'2009-11-29 19:11:33','2009-11-24 09:42:07','2010-04-05 17:02:07','2010-04-05 17:02:07',0),('tag_pharmacy,tag_medical_service,tag_medicine',34,29,2,12,'Аптека Мед-Сервис','Современная аптека на центральной улице Судака. ','Современная аптека на центральной улице Судака. ',1,'2009-11-29 19:20:17','2009-11-24 09:42:07','2010-04-05 17:01:34','2010-04-05 17:01:34',0),('tag_cinema,tag_chayka',35,30,2,13,'Кинотеатр Чайка','Кинотеатр Чайка расположен практически в центре Судака.','Кинотеатр Чайка расположен практически в центре Судака.',1,'2009-11-29 19:25:11','2009-11-24 09:42:07','2010-04-05 17:00:59','2010-04-05 17:00:59',0),('tag_mail,tag_telephone,tag_telegraph,tag_telecommunications',36,31,2,14,'Отделение почты и связи Укртелеком','Городская почта','Отделение Укртелекома предоставляет все основные профильные услуги.',1,'2009-11-29 19:32:02','2009-11-24 09:42:07','2010-04-05 17:00:22','2010-04-05 17:00:22',0),('tag_parking,tag_transport',37,32,2,7,'Автостоянка возле Кипарисовой аллеи','Автостоянка возле основной курортной зоны Судака.','Платная автостоянка возле основной курортной зоны Судака. ',1,'2009-11-29 19:37:39','2009-11-24 09:42:07','2010-04-05 16:52:49','2010-04-05 16:52:49',0),('tag_shop,tag_wine,tag_liquor',38,33,2,9,'Магазин Вина Солнечной долины','Один из целой сети небольших винных магазинов известной торговой марки.','Один из целой сети небольших винных магазинов известной торговой марки.',1,'2009-11-29 19:42:05','2009-11-24 09:42:07','2010-04-05 16:52:07','2010-04-05 16:52:07',0),('tag_seashore,tag_shore,tag_night,tag_pier',39,34,2,15,'Набережная ночью','Ночные огни судакской набережной.','Летний вечер в Судаке всегда приносит с собой ощущение праздника. И его центром конечно является набережная. Вечернее море, отражающее огни кафе и катеров, прохлада, пришедшая на смену дневному звенящему зною, нарядно одетая гуляющая курортная публика - все это манит и притягивает. Но если Вы немного устали от шумных ресторанов и дискотек, то достаточно выйти к пляжу и вдохнуть глоток свежего морского бриза, и Вы почувствуете совсем другую ночь - ночь тихого шелеста волн и загадочного ночного моря. Дорожки отражений от луны, береговых огней и иллюминации катеров и теплоходов мягко стелятся по водной поверхности, которая ещё успевает передать последние отсветы вечернего неба. Если у вас будет возможность - обязательно попробуйте искупаться в море ночью. Хотя должен предупредить что это запрещено - купаться ночью считается небезопасным занятием и, к тому-же, на ночь городские пляжи закрываются. И еще повод для беспокойства - частенько ночные купальщики не могут найти некоторых своих вещей, опрометчиво оставленных на пляже без присмотра. Но все проблемы решаемы, и если вам все-таки удастся искупаться в море ночью, я уверен, вы получите незабываемые впечатления.      ',1,'2009-12-14 12:35:08','2009-11-24 09:42:07','2010-04-05 16:50:23','2010-04-05 16:50:23',0),('tag_seashore,tag_birds,tag_swans',40,35,2,15,'Морские птицы','Зимнее кормление лебедей и других морских птиц.','Иногда, но не каждый год, в Судаке остаются на зимовку лебеди. В трудное холодное время они всей стаей подплывают к самому берегу, туда, где люди бросают хлеб. Птицы жадно бросаются за пищей, создавая давку и отбирая друг у друга добычу. Кроме лебедей, активными участниками дележа являются чайки. Обладая более высокой скоростью и маневренностью, а также немалой наглостью,они часто успевают выхватить куски хлеба прямо из-под клюва вальяжных лебедей. То тут то там мелькают черные нырки. Они значительно меньше лебедей и намного скромнее чаек, поэтому подбирают то, что не заметили другие птицы. Но в некоторые дни так много желающих подкормить птиц приходит на берег, что лебеди, наевшись, отплывают чуть дальше, игнорируя всю пищу. \r\nДля местных жителей кормление лебедей давно стало своеобразным праздником. Стая голубей носится над пляжем, подбирая крошки с песка, бегают собаки, дети радуются возможности покормить лебедей и других птиц почти с рук, суматошная борьба за лучшие куски в воде - весёлое и яркое зрелище в межсезонье.     ',1,'2009-12-14 12:35:54','2009-11-24 09:42:07','2010-04-05 16:49:40','2010-04-05 16:49:40',0),('пр опаро апро',41,36,2,15,'о пароа по ',' авпр апр апр апр апр ','пр ваоено о ео ео ео еноен',0,'2009-12-14 12:36:17','2009-11-24 09:42:07','2010-02-22 09:19:47','2010-03-02 14:06:20',0),('о впно ено ено ',42,37,2,15,'п рп авр авпр вав ','ав вап ва рывар','ры апр ыапр ыапрыапр',0,'2009-12-14 12:36:45','2009-11-24 09:42:07','2010-02-22 09:20:17','2010-03-02 14:05:55',0),('ghnghn',45,38,2,16,'hgngh','hnghnghn','hnghnghngn',0,'2010-03-02 07:02:29',NULL,'2010-03-02 07:02:30','2010-03-02 16:03:19',NULL),('tag_beach,tag_Kapsel,tag_Meganom,tag_camping',46,39,2,16,'Пляжи Капсельской долины','Популярный загородный пляж и кемпинг.','Самым доступным и, вероятно, популярным кемпингом Судака является капсельские пляжи под мысом Меганом. Хотя здешний ландшафт довольно своеобразный и напоминает пустыню (на самом деле это и есть солончаковая пустыня), а пляжи благоустроены не полностью, это место стало альтернативой часто переполненому городскому пляжу Судака. На машине не составит труда проехать несколько километров вдоль моря, чтобы попасть сюда. К воде можно подъехать, можно поставить палатку и жить постоянно. Пляжи тут разные - есть песчаные, гравийные и каменистые, выбирайте на свой вкус. С пляжа можно любоваться прекрасным видом на Новый Свет и на более далёкое побережье за ним - до самой Медведь-горы, которая хорошо видна в ясную погоду.',1,'2010-03-02 07:03:00',NULL,'2010-04-05 16:48:41','2010-04-05 16:48:41',NULL),('tag_beach,tag_Morskoe,tag_wild_beach',47,40,2,16,'Beaches near the Morske','Popular suburban beaches.','Morske Village is located on the coast to the west of Sudak. Here is a nice big beach. But if you drive a little farther in the direction of Alushta, you will see two large bays. You can left the car on the sidelines or even go  down on the beach. Here you can put an awning or a tent and stay for a few days. Unlike Sudak, beaches which are within a relatively small bay, the shore here is more open.',1,'2010-03-02 07:03:50',NULL,'2010-04-05 18:18:22','2010-04-05 18:18:22',NULL),('tag_beach,tag_winter,tag_storm',48,41,2,16,'Зимнее море','Зимний пляж в штормовую погоду.','Летом шторм в районе Судака бывает редко. Море выплескивает все свои эмоции в другие времена года. В основном - зимой. Зимой море становится совсем другим - холодным и суровым. От летней лёгкости и приятного шелеста прозрачных волн не остаётся и следа. Тёмно-серое, стальное, грязно-зелёное, чёрное, коричневое - вот цвета моря зимнего. Холодный пронизывающий ветер гонит на пустые пляжи тёмные волны, покрытые клочьями белой пены. Волна бросается на берег, потом отступает, ненадолго оставляя постепенно исчезающую блестящую плоскость песка. \r\n',1,'2010-03-02 07:05:18',NULL,'2010-04-05 16:47:26','2010-04-05 16:47:26',NULL),('tag_beach,tag_winter',49,42,2,16,'Зимний пляж','Пляж Судака зимой.','Многих интересует вопрос - замерзает-ли море зимой? Чёрное море в районе Судака не замерзает никогда. Даже если температура воздуха опускается до двадцати градусов мороза (бывает и такое, правда довольно редко) и на земле лежит снег, моря играет волнами так-же как и в другие времена года. Только в полосе прибоя на камнях или на сваях пристаней могут образовываться ледяные наросты.\r\nТемпература морской воды зимой - около 8 градусов, именно поэтому в прибрежной зоне зима значительно теплее чем, скажем, даже километров на 40 вглубь полуострова. Но по этой-же причине весна на побережье обычно холодная и затяжная. Пока огромные массы воды не прогреются лучами весеннего солнца, до тех пор промозглые туманы будут почти ежедневно накрывать поля и долины меж гор. Для тех, кто хочет приехать в Судак на отдых именно весной, стоит учесть этот момент. \r\nНо пока идет зима. Безлюдные пляжи на холоде потеряли свои летние яркие краски и сменили их на мягкие авкварельные тона. ',1,'2010-03-02 07:05:46',NULL,'2010-04-05 16:46:48','2010-04-05 16:46:48',NULL),('tag_wild_beach,tag_bay_gravel,tag_beach,tag_diving',44,43,2,16,'Гравийная Бухта - дикий пляж','Прекрасное место для дайверов.','В Гравийной бухте на мысе Меганом есть прекрасный маленький пляж с чистейшей водой, окруженный со всех сторон, кроме южной, высокими скалами. Отдых здесь подойдёт не всем, но если Вы любите проводить время на природе, это место имеет все шансы Вас очаровать. Если вы любитель дайвинга, то Гравийную бухту Вам пропустить нельзя никак. Она славится именно чистотой воды, почти уникальной для Чёрного моря.      ',1,'2010-03-02 07:08:55',NULL,'2010-04-05 16:45:28','2010-04-05 16:45:28',NULL),('tag_spring,tag_april,tag_flowers',50,44,23,10,'Судак в конце апреля','Свежие краски весеннего Крыма','Весна в приморских районах Крыма это время неустойчивости и неуверенности. Только что дул пронизывающий северный ветер а через полчаса солнце берёт реванш и заставляет снимать порядком надоевшую за зиму верхнюю одежду. Холодные туманы с моря постепенно уступают место теплу приближающегося лета. Окружающие Судак горы и холмы покрываются изысканными в своей скромности крымскими цветами.   ',0,'2010-04-26 19:07:07',NULL,'2010-04-26 19:38:59','2010-04-26 19:51:54',NULL);
