INSERT INTO `attachment_comment_translations` VALUES (1,1,'ru','Вид с набережной Судака в ноябре. Людей нет и некоторые фонари спрятаны до весны.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(2,2,'ru','Чуть далее в этой стороне находится Зеленогорье.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(3,3,'ru','Тут можно увидеть результат дождевой эррозии. Иногда такие яры приходится обходить большим крюком, так как их склоны бывают достаточно крутыми. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(4,4,'ru','Склоны покрыты лесом только местами. Из деревьев тут растут в основном сосны, небольшие дубы и грабы.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(5,5,'ru','Синяя полоса скрывает более далекие вершины, похоже, там идет дождь.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(6,6,'ru','Летом эти места будут выглядеть немного по-другому, в том числе и из-за горячих потоков воздуха от земли. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(7,7,'ru','Черное море бывает и такого цвета. Хорошо видно как чистая синяя вода вдали сменяется сначала на зеленоватую, а затем ближе к берегу на коричневую. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(8,8,'ru','Зима - время штормов на Чёрном море, летом они бывают редко. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(9,9,'ru','Прибытие. С моря открывается красивый вид на весь берег от мыса Меганом и до гор Нового Света. Видимость более далеких гор по направлению к Ялте зависит только от погоды.   ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(10,10,'ru','Наверху много старых живописных деревьев. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(11,11,'ru','Сквозь почти сплошную облачность пробиваются отдельные лучи солнечного света.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(12,12,'ru','Конечно, это не Красное море, но бухта с честью подтверждает славу одного из мест с очень чистой водой','2009-10-05 00:00:00','2009-10-05 00:00:00'),(13,13,'ru','При отсутствии шторма покинуть катер несложно. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(14,14,'ru','Иногда облачное небо идеально дополняет строгость водной поверхности.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(15,15,'ru','Любителям очень советуем взять с собой свои принадлежности для подводного плавания.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(16,16,'ru','Во времена Советского Союза было целое движение по пропагандированию родов в воде именно в этом месте - в бухте Гравийной.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(17,17,'ru','Это угол наклона пологого склона возле вершины. Крутой склон обрывается почти отвесной стеной с высоты более 400 метров.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(18,18,'ru','Белизна морской пены только частично скрывает грязный цвет волны. К сожалению на Чёрном море шторм и чистая вода несовместимые понятия. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(19,19,'ru','Взгляд на восток - можно видеть известный потухший вулкан Кара-Даг в нежных розово-голубых тонах. Если идти вдоль берега моря в ту сторону, можно попасть в Лисью бухту, а далее - Курортное и сам Кара-Даг.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(20,20,'ru','Вид в номере.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(21,21,'ru','Одно из мест для отдыха.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(22,22,'ru','Внизу, в дымке, видна большая часть Судака.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(23,23,'ru','Вид с второго этажа. На этаже всего два номера. Справа виднеется Судакская крепость.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(24,24,'ru','По этой тропинке и поднимаются на вершину. Из-за значительной крутизны Сокола, тропинка ведет свой путь диагональю по северному склону горы.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(25,25,'ru','Предлагаем уютные двух- и трехместные номера.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(26,26,'ru','Цвет винограда на этом участке заставляет вспомнить Ван Гога и его \"Красные виноградники в Арле\". Вот только виноград здесь уже давно весь убран и поля, штопаные аккуратными белыми столбиками, абсолютно безлюдны.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(27,27,'ru','За полями начинают подниматься вверх холмы, изрезанные потоками воды.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(28,28,'ru','Окно выходит на юг. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(29,29,'ru','Невысокие холмы постепенно сменяются горами с красивыми скалистыми вершинами.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(30,30,'ru','Вид номера.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(31,31,'ru','Номера находятся на втором этаже, на первом - санузлы и душ. Всегда есть горячая и холодная вода.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(32,32,'ru','Можно видеть последний к востоку массив Крымских гор. Он тянется до Коктебеля, а затем начинается степной Крым.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(33,33,'ru','В пасмурную погоду даже горы становятся более \"мягкими\", но все-равно выглядят довольно внушительно.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(34,34,'ru','Большой номер на первом этаже для трех или четырех человек.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(35,35,'ru','Участок дороги в Солнечную долину. Из Судака дорога идет вдоль моря по Капсельской долине до мыса Меганом, затем огибает его и уходит ближе к горам. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(36,36,'ru','Кухня с плитой, посудой и холодильником. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(37,37,'ru','В четкой монотонности виноградных рядов одинокий кипарис заставляет обратить на себя внимание.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(38,38,'ru','Считается, что наличие таких лишайников на камнях свидетельствует об отменной чистоте местного воздуха. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(39,39,'ru','Видны развалины Сторожевой Башни, одного из большого количества исторических строений Крыма. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(40,40,'ru','Посёлок Солнечная Долина известен неплохим натуральным вином под одноименной маркой.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(41,41,'ru','Видны почти безлесые солончаковые холмы. Акварельная мягкость красок земляных оттенков создает настроение некоторой отрешенности.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(42,42,'ru','Солнце почти театрально подсветило горную гряду над Солнечной Долиной.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(43,43,'ru','Если с этой точки посмотреть на юг, на мыс Меганом, присмотревшись, можно увидеть на его склоне электрогенерирующие ветряки. Внизу среди холмов виднеется небольшое пресноводное озеро Бугаз.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(44,44,'ru','Вот она - зима в Крыму, посмотрите.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(45,45,'ru','Может кто-то объяснить что это значит? Вообще тут много такого есть - магические алтари, лабиринты, следы инопланетян.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(46,46,'ru','Если посмотреть в другую сторону, на юг, можно увидеть совсем другой ландшафт, который при такой освещенности имеет немного нереальный вид. Вдали справа - мыс Меганом.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(47,47,'ru','На самом деле каменистых участков тут немного, почти всю площадь пляжей покрывает мелкая галька или песок.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(48,48,'ru','Различные цвета ягод винограда различных сортов и вин, из них сделанных, дополняются эффектным разнообразием листьев.  ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(49,49,'ru','Угол подъема не слишком крутой, вдали виднеются, чуть фиолетовые, соседние горы.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(50,50,'ru','Хорошо виден средний уровень высоты Крымских гор. Чуть далее за горами на снимке - уже Южный Берег, до Ялты от Судака всего около восьмидесяти километров по южной дороге. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(51,51,'ru','С правой стороны - обширная Капсельская бухта. Теперь это также популярный загородный пляж, куда удобнее добираться на машине. Почти в центре находится гора Алчак. Виден Судак, характерный силуэт горы Сокол, а далее - бухты Нового Света. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(52,52,'ru','Яркое пятно вдали привлекает внимание контрастом горячих желто-красных цветов с насыщенным зеленым и спокойным серым. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(53,53,'ru','По сравнению с Большой Ялтой места близ Судака выглядят чуть не пустыней, но этот образ не менее своеобразен и интересен. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(54,54,'ru','Различные цвета ягод винограда различных сортов и вин, из них сделанных, дополняются эффектным разнообразием листьев.  ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(55,55,'ru','Угол подъема не слишком крутой, вдали виднеются, чуть фиолетовые, соседние горы.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(56,56,'ru','Хорошо виден средний уровень высоты Крымских гор. Чуть далее за горами на снимке - уже Южный Берег, до Ялты от Судака всего около восьмидесяти километров по южной дороге. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(57,57,'ru','С правой стороны - обширная Капсельская бухта. Теперь это также популярный загородный пляж, куда удобнее добираться на машине. Почти в центре находится гора Алчак. Виден Судак, характерный силуэт горы Сокол, а далее - бухты Нового Света. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(58,58,'ru','Яркое пятно вдали привлекает внимание контрастом горячих желто-красных цветов с насыщенным зеленым и спокойным серым. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(59,59,'ru','По сравнению с Большой Ялтой места близ Судака выглядят чуть не пустыней, но этот образ не менее своеобразен и интересен. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(60,60,'ru','Различные цвета ягод винограда различных сортов и вин, из них сделанных, дополняются эффектным разнообразием листьев.  ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(61,61,'ru','Угол подъема не слишком крутой, вдали виднеются, чуть фиолетовые, соседние горы.','2009-10-05 00:00:00','2009-10-05 0