е пустыней, но этот образ не менее своеобразен и интересен. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(72,72,'ru','Почти в центре видна дорога в Морское, до него на машине добираться не больше пяти минут.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(73,73,'ru','Виноградные кусты закреплены на проволке, натянутой на бетонные колья.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(74,74,'ru','Почти все работы по выращиванию виноградной лозы выполняются вручную.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(75,75,'ru','Со стороны Судака Меганом выглядит немного унылой и неинтересной глиняной глыбой. На самом деле на нем достаточно много растительности, есть масса красивых бухт и живописных скал. Просто все это можно увидеть, только пройдя по его многочисленным тропам. Но сейчас сделаем наоборот - бросим взгляд с Меганома на побережье к Судаку. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(76,76,'ru','Идти по извилистой тропинке по жаре нелегко. но море прохладой наградит всех, кто осилит спуск.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(77,77,'ru','С этой точки видны пляжи Судака, а волнорезы внизу - это небольшой пляж в Уютном. Бывший поселок Уютное сейчас входит в состав Судака. Уютнинский пляж отделен от судакских пляжей Крепостной горой. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(78,78,'ru','Вид с вершины горы Сокол на море. Конечно, снимок не может передать и часть реального впечатления от открывающегося простора.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(79,79,'ru','Кажется, горы подчинены некоторому ритму, который сложно выразить словами, но увидеть - возможно.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(80,80,'ru','Эта тропинка может привести Вас на самую вершину одной из красивейших гор Судака - Сокол.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(81,81,'ru','Бросим взгляд в сторону Судака. Внизу видна дорога из Нового Света, ниже которой располагаются каменистый берег. Далее еле видна в дымке Крепостная гора, на которой расположена известная Генуэзская крепость. Еще дальше виднеется прибрежная часть Судака. Закрывает Судакскую бухту с востока гора Алчак.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(82,82,'ru','На одном из поворотов тропинки между деревьями появилась Генуэзская, или Судакская, крепость. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(84,84,'ru','Оптимистичность таких пейзажей подтверждена - многие люди ощущают значительный душевный подъем в этих местах, который только усиливает прием хорошего местного вина.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(85,85,'ru','Вид на гору Сокол со стороны моря. Внизу видна дорога из Судака в Новый Свет. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(86,86,'ru','В трещинах сплошной каменной глыбы растут даже сосны.  ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(87,87,'ru','Тропинка ведет по довольно крутому склону, поросшему туями и можжевельником.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(88,88,'ru','Вид на противоположную от моря сторону. В отличии от Сокола, горы вокруг имеют намного более пологие склоны.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(89,89,'ru','Банально говорить, что в таких местах все мелкие неприятности города уходят из сознания человека, но это действительно так.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(90,90,'ru','Специфический приятный запах сосен и можжевельника, белые известковые скалы вокруг, бледнеющая синева далеких гор вдали - основные составляющие впечатлений этого места.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(91,91,'ru','Местные жители считают что гора Сокол \"притягивает\" к себе облака и тучи. Справа внизу видна заострённая скала под названием Чертов Палец.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(92,92,'ru','Почти все гуляющие включают в свой вечерний маршрут городской причал.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(93,93,'ru','Желающие могут ночью совершить интересную морскую прогулку на одном из небольших теплоходов.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(94,94,'ru','Если пройти по берегу к крепости, то перед Вами откроется вид на всю Судакскую бухту. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(95,95,'ru','Свет фонарей освещает часть пляжа и сложенные до утра лежаки и катамараны.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(96,96,'ru','На городском пляже возле причала.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(98,98,'ru','На пляже лежит тонкий слой снега, температура воздуха - минус три градуса. Для Судака это холодно.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(99,100,'ru','Городской причал пуст - зимой все теплоходы и катера находятся на берегу.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(100,101,'ru','Ледяные наросты на сваях - это все что может сделать мороз с соленой чёрноморской водой.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(101,102,'ru','Пустой городской пляж заняли лебеди. Этих красивых птиц жители города подкармливают и не обижают.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(102,103,'ru','Низкое зимнее солнце не может дать летней яркости красок. Горы, море и небо - везде спокойные мягкие тона.  ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(103,104,'ru','Пронзительно-голубое небо и коричнево-грязные волны можно наблюдать в редкий ясный зимний день. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(104,105,'ru','Волнорезы выполняют свою основную функцию - не дают волнам смыть песок с пляжей. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(105,106,'ru','Волны легко накрывают весь пляж. Бывает, что сильный шторм разрушает и часть набережной.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(106,107,'ru','Чтобы получить полное впечатление от такого шторма, его нужно слышать. Грохот волн и шум ветра вместе с летящими с моря солёными брызгами воды - обязательные составляющие такого, довольно сильного по местным меркам, шторма.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(107,108,'ru','Сильного шторма боятся и корабли. Сухогрузы в такое время стараются укрыться от непогоды в ближайших бухтах.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(108,110,'ru','На мысе видны развалины строжевой башни, из которой наблюдали за всеми проплывающими кораблями. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(109,111,'ru','Крупные камни вносят разнообразие в плоскость мелкогалечного пляжа.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(110,112,'ru','Дорога на Алушту в этом месте проходит прямо по берегу.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(111,113,'ru','Дорога на Алушту проходит в основном в горах, и возможность подъехать к морю представится путешественникам не часто.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(112,114,'ru','Почувствуйте ощущение простора и даже некоторой торжественности.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(113,115,'ru','Так близко к берегу и к людям эти птицы приближаются только зимой.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(114,116,'ru','Чайки - настоящие морские разбойники, заберут всё у зазевавшейся или просто более мелкой птицы. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(115,117,'ru','На этот раз лебеди держатся в отдалении, но бывают дни, когда они почти выходят на берег к людям. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(116,118,'ru','С громкими криками чайки носятся над водой, и, высмотрев добычу, камнем бросаются на неё.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(117,119,'ru','Лебеди обычно держатся плотными группами, но иногда одна или две птицы держатся от стаи на большом расстоянии.  ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(118,120,'ru','Дайверам сюда лучше добираться на катере.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(119,121,'ru','Пляж находится достаточно далеко от города, поэтому людей тут обычно немного','2009-10-05 00:00:00','2009-10-05 00:00:00'),(120,122,'ru','По сравнению с городским пляжем, здесь прямо нереальная чистота.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(121,123,'ru','Чем не средиземноморье? На этом снимке легко оценить прозрачность воды.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(122,124,'ru','Это конечно не кораллы, но, на мой взгляд, берег выглядит достаточно экзотично.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(123,126,'ru','Под самым мысом Меганом располагается довольно большой пляж. Рядом есть выносная торговля и простые летние кафе.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(124,128,'ru','Тут можно примерно оценить расстояние до Судака - он находится перед большой горой слева на снимке.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(125,129,'ru','Виден посёлок Новый Свет, мыс Капчик слева и гора Сокол справа. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(126,130,'ru','Так как людей здесь значительно меньше, чем отдыхает на городском пляже, вода тут намного чище.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(127,131,'ru','Вид сверху на Капсельскую долину. Снимок сделан осенью, трава жёлтая, и долина кажется самой настоящей пустыней. ','2009-10-05 00:00:00','2009-10-05 00:00:00'),(128,1,'uk','Вид з набережної Судака в листопаді. Людей немає і деякі ліхтарі заховані до весни.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(129,2,'uk','Трохи далі в цій стороні знаходиться Зеленогірьє.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(130,3,'uk','Тут можна побачити результат дощової ерозії. Іноді такі яри доводиться обходити великим гаком, так як їх схили бувають досить крутими.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(131,4,'uk','Схили покриті лісом тільки місцями. З дерев тут ростуть в основному сосни, невеликі дуби і граби.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(132,5,'uk','Синя смуга приховує більш далекі вершини, схоже, там йде дощ.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(133,6,'uk','Влітку ці місця будуть виглядати трохи по-іншому, в тому числі і з-за гарячих потоків повітря від землі.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(134,7,'uk','Чорне море буває і такого кольору. Добре видно як чиста синя вода здалеку змінюється спочатку на зеленувату, а потім, ближче до берега, на коричневу','2009-10-05 00:00:00','2009-10-05 00:00:00'),(135,8,'uk','Зима - час штормів на Чорному морі, влітку вони бувають рідко.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(136,9,'uk','Прибуття. З моря відкривається гарний вид на весь берег від мису Меганом і до гір Нового Світу. Видимість більш далеких гір у напрямку до Ялти залежить тільки від погоди.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(137,10,'uk','Нагорі багато старих мальовничих дерев.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(138,11,'uk','Крізь майже суцільну хмарність пробиваються окремі промені сонячного світла.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(139,12,'uk','Звичайно, це не Червоне море, але бухта з честю підтверджує славу одного з місць з дуже чистою водою.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(140,13,'uk','При відсутності шторму покинути катер нескладно.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(141,14,'uk','Іноді хмарне небо ідеально доповнює строгість водної поверхні.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(142,15,'uk','Дайвінгістам дуже радимо взяти з собою спорядження  для підводного плавання.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(143,16,'uk','За часів Радянського Союзу був цілий рух з пропагування пологів у воді саме в цьому місці - в бухті Гравійній.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(144,17,'uk','Це кут нахилу пологого схилу біля вершини. Крутий схил обривається майже стрімкою стіною з висоти більше 400 метрів.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(145,18,'uk','Білизна морської піни тільки частково приховує брудний колір хвилі. На жаль на Чорному морі шторм і чиста вода несумісні речі.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(146,19,'uk','Погляд на схід - можна бачити відомий згаслий вулкан Кара-Даг у ніжних рожево-блакитних тонах. Якщо йти вздовж берега моря в той бік, можна потрапити у Лисячу бухту, а далі - Курортне і сам Кара-Даг.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(147,20,'uk','Вид в номері.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(148,21,'uk','Одне з місць для відпочинку.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(149,22,'uk','Внизу, в серпанку, видно велику частину Судака.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(150,23,'uk','Вид з другого поверху. На поверсі лише два номери. Справа можна бачити Судацьку фортецю.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(151,24,'uk','По цій стежці і піднімаються на вершину. Через значну крутизни Сокола, стежка веде свій шлях діагоналлю по північному схилу гори.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(152,25,'uk','Пропонуємо затишні дво-та тримісні номери.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(153,26,'uk','Колір винограду на цій ділянці змушує згадати Ван Гога та його \"Червоні виноградники в Арле\". Ось тільки виноград тут вже давно весь прибраний і поля, штопані акуратними білими стовпчиками, абсолютно безлюдні.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(154,27,'uk','За полями починають підніматися вгору пагорби, порізані потоками води.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(155,28,'uk','Вікно виходить на південь.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(156,29,'uk','Невисокі пагорби поступово змінюються горами з красивими скелястими вершинами.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(157,30,'uk','Вид номера.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(158,31,'uk','Номери знаходяться на другому поверсі, на першому - санвузли та душ. Завжди є гаряча і холодна вода.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(159,32,'uk','Можна бачити останній на схід масив Кримських гір. Він тягнеться до Коктебеля, а потім починається степовий Крим.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(160,33,'uk','У похмуру погоду навіть гори стають більш мякими, але все одно виглядають досить переконливо.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(161,34,'uk','Большой номер на первом этаже для трех или четырех человек.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(162,35,'uk','Ділянка дороги в Сонячну долину. З Судака дорога йде уздовж моря з Капсельської долини до мису Меганом, потім огинає його і йде ближче до гір','2009-10-05 00:00:00','2009-10-05 00:00:00'),(163,36,'uk','Кухня з плитою, посудом і холодильником.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(164,37,'uk','У чіткої монотонності виноградних рядів самотній кипарис змушує звернути на себе увагу.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(165,38,'uk','Вважається, що наявність таких лишайників на каменях свідчить про відмінну чистоту місцевого повітря.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(166,39,'uk','Видно руїни Вартової Башти, однієї з великої кількості історичних будівель Криму.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(167,40,'uk','Селище Сонячна Долина відоме непоганим натуральним вином під однойменною маркою.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(168,41,'uk','Видно майже безлісі солончакові пагорби. Акварельна мякість фарб земляних відтінків створює настрій деякої відчуженості.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(169,42,'uk','Сонце майже театрально підсвітило гірське пасмо над Сонячної Доліної.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(170,43,'uk','Якщо з цієї точки подивитися на південь, на мис Меганом, придивившись, можна побачити на його схилі електрогенеруючі вітряки. Внизу серед пагорбів видніється невелике озеро Бугаз.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(171,44,'uk','Ось вона - зима в Криму, подивіться.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(172,45,'uk','Може хтось пояснити що це значить? Взагалі тут багато такого є - магічні вівтарі, лабіринти, сліди інопланетян.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(173,46,'uk','Якщо подивитися в інший бік, на південь, можна побачити зовсім інший ландшафт, що при такому освітленості має трохи нереальний вигляд. Вдалині справа - мис Меганом.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(174,47,'uk','Насправді камянистих ділянок тут небагато, майже всю площу пляжів вкриває дрібна галька або пісок.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(175,48,'uk','Різні кольори ягід винограду різних сортів  доповнюються ефектним різноманітністтям листя.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(176,49,'uk','Кут підйому не дуже крутий, вдалині видніються, трохи фіолетові, сусідні гори.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(177,50,'uk','Добре видно середній рівень висоти Кримських гір. Трохи далі за горами на знімку - вже Південний Берег, до Ялти від Судака всього близько вісімдесяти кілометрів по південній дорозі.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(178,51,'uk','З правого боку - велика Капсельська бухта. Тепер це також популярний заміський пляж, куди зручніше добиратися на машині. Майже в центрі знаходиться гора Алчак. Видно Судак, характерний силует гори Сокіл, а далі - бухти Нового Світу.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(179,52,'uk','Яскрава пляма здалека привертає увагу контрастом гарячих жовто-червоних кольорів з насиченим зеленим і спокійним сірим.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(180,53,'uk','У порівнянні з Великою Ялтою місця поблизу Судака виглядають мало не пустелею, але цей образ не менш своєрідний і цікавий.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(181,54,'uk','Різні кольори ягід винограду різних сортів доповнюється ефектною різноманітністю листя.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(182,55,'uk','Кут підйому не дуже крутий, вдалині видніються, трохи фіолетові, сусідні гори.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(183,56,'uk','Добре видно середній рівень висоти Кримських гір. Трохи далі за горами на знімку - вже Південний Берег, до Ялти від Судака всього близько вісімдесяти кілометрів по південній дорозі.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(184,57,'uk','З правого боку - велика Капсельська бухта. Тепер це також популярний заміський пляж, куди зручніше добиратися на машині. Майже в центрі знаходиться гора Алчак. Видно Судак, ха