р. Трохи далі за горами на знімку - вже Південний Берег, до Ялти від Судака всього близько вісімдесяти кілометрів по південній дорозі.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(196,69,'uk','З правого боку - велика Капсельська бухта. Тепер це також популярний заміський пляж, куди зручніше добиратися на машині. Майже в центрі знаходиться гора Алчак. Видно Судак, характерний силует гори Сокіл, а далі - бухти Нового Світу.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(201,71,'uk','У порівнянні з Великою Ялтою місця поблизу Судака виглядають мало не пустелею, але цей образ не менш своєрідний і цікавий.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(202,70,'uk','Яскрава пляма здалека привертає увагу контрастом гарячих жовто-червоних кольорів з насиченим зеленим і спокійним сірим.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(203,72,'uk','Майже в центрі видно дорогу в Морське, до нього на машині добиратися не більше пяти хвилин.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(204,73,'uk','Виноградні кущі закріплені на дроти, натягнуті на бетонні палі.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(205,74,'uk','Майже всі роботи з вирощування виноградної лози виконуються вручну.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(206,75,'uk','З боку Судака Меганом виглядає трохи похмурою і нецікавою глиняною брилою. Насправді на ньому досить багато рослинності, є багато красивих бухт і мальовничих скель. Просто все це можна побачити, тільки пройшовши по його численних стежках. Але зараз зробимо навпаки - кинемо погляд з Меганома на узбережжі до Судаку.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(207,76,'uk','Йти по звивистій стежці по жарі нелегко. але море прохолодою нагородить всіх, хто подужає спуск.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(208,77,'uk','З цієї точки видно пляжі Судака, а хвилерізи внизу - це невеликий пляж у Затишному. Колишнє селище Затишне зараз входить до складу Судака. Цей пляж відділений від судацьких пляжів Фортечною горою.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(209,78,'uk','Вид з вершини гори Сокіл на море. Звичайно, знімок не може передати і частини реального враження від  простору, що відкривається.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(210,79,'uk','Здається, гори підпорядковані певному ритму, який складно виразити словами, але побачити - можливо.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(211,80,'uk','Ця стежка може привести Вас на саму вершину однієї з найкрасивіших гір Судака - Сокіл.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(212,81,'uk','Кинемо погляд у бік Судака. Внизу видно дорогу з Нового Світу, нижче за яку розташовуються камянистий берег. Далі ледве видно в серпанку Фортечну гору, на якій розташована відома Генуезька фортеця. Ще далі видніється прибережна частина Судака. Закриває Судакську бухту зі сходу гора Алчак.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(214,84,'uk','Оптимістичність таких пейзажів підтверджена - багато людей відчувають значний душевний підйом в цих місцях, який тільки підсилює прийом доброго місцевого вина.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(215,82,'uk','На одному з поворотів стежки між деревами зявилася Генуезька, або Судацька, фортеця.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(216,85,'uk','Вид на гору Сокіл з боку моря. внизу видно дорога з Судака у Новий Світ.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(217,86,'uk','У тріщинах суцільної камяної брили ростуть навіть сосни.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(218,87,'uk','Стежка веде по досить крутому схилу, порослому туями і ялівцем.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(219,88,'uk','Вид на протилежний від моря бік. На відміну від Сокола, гори навколо мають набагато більш пологі схили.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(220,89,'uk','Банально говорити, що в таких місцях всі дрібні неприємності міста йдуть зі свідомості людини, але це дійсно так.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(221,90,'uk','Специфічний приємний запах сосен та ялівцю, білі вапняні скелі навколо, бліда синява далеких гір вдалині - основні складові вражень цього місця.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(222,91,'uk','Місцеві жителі вважають що гора Сокіл \"притягує\" до себе хмари. Справа внизу видно загострена скеля під назвою Чортів Палець.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(223,92,'uk','Майже всі гуляючі включають в свій вечірній маршрут міський причал.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(224,93,'uk','Бажаючі можуть вночі зробити цікаву морську прогулянку на одному з невеликих теплоходів.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(225,94,'uk','Якщо пройти по берегу до фортеці, то перед Вами відкриється вид на всю Судацьку бухту.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(226,95,'uk','Світло ліхтарів висвітлює частина пляжу і складені до ранку лежаки і катамарани.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(227,96,'uk','На міському пляжі біля причалу.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(228,98,'uk','На пляжі лежить тонкий шар снігу, температура повітря - мінус три градуси. Для Судака це холодно.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(229,100,'uk','Міський причал порожній - взимку всі теплоходи і катери знаходяться на березі.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(230,101,'uk','Крижані нарости на палях - це все що може зробити мороз з солоною чорноморською водою.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(231,102,'uk','Порожній міський пляж зайняли лебеді. Цих красивих птахів жителі міста підживлюють і не кривдять.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(232,103,'uk','Низьке зимове сонце не може дати літньої яскравості фарб. Гори, море і небо - скрізь спокійні мякі тони.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(233,104,'uk','Пронизливо-блакитне небо і коричнево-брудні хвилі можна бачити в рідкісний ясний день взимку.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(234,105,'uk','Хвилерізи виконують свою основну функцію - не дають хвилям змити пісок з пляжів.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(235,106,'uk','Хвилі легко накривають весь пляж. Буває що сильний шторм руйнує і частину набережної.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(236,107,'uk','Щоб отримати повне враження від такого шторму, його потрібно чути. Гуркіт хвиль і шум вітру разом з  солоними бризками води, що летять з моря - обовязкові складові такого, досить сильного за місцевими мірками, шторму.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(237,108,'uk','Сильного шторму бояться і кораблі. Сухогрузи в такий час намагаються сховатися від негоди в найближчих бухтах.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(238,110,'uk','На мисі видно руїни строжевой вежі, з якої спостерігали за всіма пропливаючими кораблями.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(239,111,'uk','Великі камені вносять різноманітність у площину дрібногалечного пляжу.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(240,112,'uk','Дорога на Алушту у цьому місці проходить прямо по березі.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(241,113,'uk','Дорога на Алушту проходить в основному в горах, і можливість спуститися до моря випаде не часто.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(242,114,'uk','Відчуйте простір і навіть деяку урочистість.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(243,115,'uk','Так близько до берега і до людей ці птахи наближаються тільки взимку.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(244,116,'uk','Чайки - справжні морські розбійники, заберуть все у більш дрібної птиці.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(245,117,'uk','На цей раз лебеді тримаються на відстані, але бувають дні, коли вони майже виходять на берег до людей.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(246,118,'uk','З гучними криками чайки носяться над водою, і, побачивши здобич, каменем кидаються на неї.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(247,119,'uk','Лебеді зазвичай тримаються щільними групами, але іноді один або два птахи відлітають від зграї на велику відстань.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(248,120,'uk','Дайверам сюди краще добиратися на катері.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(249,121,'uk','Пляж досить далеко від міста, тому людей тут зазвичай небагато.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(250,122,'uk','У порівнянні з міським пляжем, тут просто нереальна чистота.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(251,123,'uk','Чим не на Середземноморї? На цьому знімку легко оцінити прозорість води.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(252,124,'uk','Це звичайно не корали, але, на мій погляд, берег виглядає досить екзотично.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(253,126,'uk','Під самим мисом Меганом розташовується досить великий пляж. Поруч є виносна торгівля і прості літні кафе.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(254,127,'uk','Тут можна приблизно оцінити відстань до Судака - він знаходиться перед великою горою зліва знімка.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(255,129,'uk','Видно селище Новий Світ, мис Капчик ліворуч і гору Сокіл справа.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(256,130,'uk','Так як людей тут значно менше, ніж відпочиває на міському пляжі, вода тут набагато чистіше.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(257,131,'uk','Вид зверху на Капсельську долину. Знімок зроблено восени, трава жовта, і долина здається справжнісінькою пустелею.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(258,1,'en','View from the embankment of Sudak in November. There are not people there and some lights are hidden until spring.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(259,2,'en','There is Zelenogorye a little further in this side.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(260,3,'en','You can see the result of rain erosion. Sometimes these pits have to bypass by big hook  because their slopes are quite steep.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(261,4,'en','The slopes are cove