67,113,'en','Road to Alushta is mainly in the mountains. Travelers do not often have the opportunity to drive up to the sea.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(368,114,'en','Feel the sense of space and even a certain solemnity.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(369,115,'en','Birds are approaching close to the shore and to the people only in winter.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(370,116,'en','Seagulls are the real pirates. They take away everything from unwary or smaller birds.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(371,117,'en','Swans are kept at a distance now, but there are days when they almost went to the bank to the people.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(372,118,'en','Gulls hover over the water with loud cries and quickly rush to the prey.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(373,119,'en','Swans usually stay in dense groups, but sometimes one or two birds are kept from the pack at a great distance.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(374,120,'en','Divers need to get here by boat.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(375,121,'en','The beach is far from the city, so people here are usually a little.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(376,122,'en','It is very clean compared to the urban beach.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(377,123,'en','Why not the Mediterranean? In this picture you can easily assess the transparency of water.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(378,124,'en','This is certainly not coral, but, in my opinion, the beach looks rather exotic.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(379,126,'en','Quite a large beach is located beneath the Cape Meganom. Nearby is the tanker trade and simple open-air cafes.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(380,128,'en','You can roughly estimate the distance to Sudak. It is in front of a large hill on the left of the picture.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(381,129,'en','There are  New World, Cape Kapchik left and Mount Falcon right.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(382,130,'en','The water here is much cleaner.','2009-10-05 00:00:00','2009-10-05 00:00:00'),(383,131,'en','This is a top view of Kapsel valley. The picture was taken in the autumn, the grass is yellow, and the valley like a desert.','2009-10-05 00:00:00','2009-10-05 00:00:00');
