INSERT INTO `attachment_comments` VALUES (1,'Вид с набережной Судака в ноябре. Людей нет и некоторые фонари спрятаны до весны.',565,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(2,'Чуть далее в этой стороне находится Зеленогорье.',596,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(3,'Тут можно увидеть результат дождевой эррозии. Иногда такие яры приходится обходить большим крюком, так как их склоны бывают достаточно крутыми. ',595,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(4,'Склоны покрыты лесом только местами. Из деревьев тут растут в основном сосны, небольшие дубы и грабы.',594,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(5,'Синяя полоса скрывает более далекие вершины, похоже, там идет дождь.',592,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(6,'Летом эти места будут выглядеть немного по-другому, в том числе и из-за горячих поков воздуха от земли. ',593,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(7,'Черное море бывает и такого цвета. Хорошо видно как чистая синяя вода вдали сменяется сначала не зеленоватую, а затем на коричневую возле самого берега. ',566,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(8,'Зима - время штормов на Черном море, летом они бывают редко. ',567,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(9,'Прибытие. С моря открывается красивый вид на весь берег от мыса Меганом и до гор Нового Света. Видимость более далеких гор по направлению к Ялте зависит только от погоды.   ',551,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(10,'Наверху много старых живописных деревьев. ',538,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(11,'Сквозь почти сплошную облачность пробиваются только отдельные лучи солнечного света.',539,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(12,'Конечно, это не Красное море, но бухта с честью подтверждает славу одного из мест с очень чистой водой',553,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(13,'При отсутствии шторма покинуть катер несложно. ',552,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(14,'Иногда облачное небо идеально дополняет строгость водной поверхности.',568,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(15,'Любителям очень советуем взять с собой свои принадлежности для подводного плавания.',554,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(16,'Во времена Советского Союза было целое движение по пропагандированию родов в воде именно в этом месте - в бухте Гравийной.',555,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(17,'Это угол наклона пологого склона возле вершины. Крутой склон обрывается почти отвесной стеной с высоты более 500 метров.',537,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(18,'Белизна морской пены только частично скрывает грязный цвет волны. К сожалению на Черном море шторм и чистая вода это несовместимые понятия. ',569,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(19,'Взгляд на восток - можно видеть известный потухший вулкан Кара-Даг в нежных розово-голубых тонах. Если идти вдоль берега моря в ту сторону, можно попасть в Лисью бухту, а далее - Курортное и сам Кара-Даг.',581,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(20,'Вид в номере.',606,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(21,'Одно из мест для отдыха.',609,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(22,'Внизу, в дымке, видна большая часть Судака.',541,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(23,'Вид с второго этажа. На этаже всего два номера. Справа виднеется Судакская крепость.',599,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(24,'По этой тропинке и поднимаются на вершину. Из-за значительной крутизны Сокола, тропинка ведет свой путь диагональю по западному склону горы.',540,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(25,'Предлагаем уютные двух и трехместные номера.',605,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(26,'Цвет винограда на этом участке заставляет вспомнить Ван Гога и его \"Красные виноградники в Арле\". Вот только винград здесь уже давно весь убран и поля, штопанные аккуратными белыми столбиками, абсолютно безлюдны.',587,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(27,'За полями начинают подниматься вверх холмы, изрезанные потоками воды.',589,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(28,'Окно выходит на юг. ',601,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(29,'Невысокие холмы постепенно сменяются горами с красивыми скалистыми вершинами.',579,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(30,'Вид номера.',600,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(31,'Номера находятся на втором этаже, на первом - санузлы и душ. Всегда есть горячая и холодная вода.',603,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(32,'Можно видеть последний к востоку массив Крымских гор. Он тянется до Коктебеля, а затем начинается степной Крым.',582,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(33,'В пасмурную погоду даже горы становятся более \"мягкими\", но все-равно выглядят довольно внушительно.',580,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(34,'Большой номер на первом этаже для трех или четырех человек.',608,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(35,'Участок дороги в Солнечную долину. Из Судака дорога идет вдоль моря по Капсельской долине до мыса Меганом, затем огибает его и уходит ближе к горам. ',586,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(36,'Кухня с плитой, посудой и холодильником. ',607,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(37,'В четкой монотонности виноградных рядов одинокий кипарис заставляет обратить на себя внимание.',588,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(38,'Считается, что наличие таких лишайников на камнях свидетельствует об отменной чистоте местного воздуха. ',573,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(39,'Видны развалины Сторожевой Башни, одного из большого количества исторических строений Крыма. ',612,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(40,'Поселок Солнечная Долина известен неплохим наткральным вином под одноименной маркой.',574,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(41,'Видны почти безлесые солончаковые холмы. Акварельная мягкость красок земляных оттенков создает настроение некоторой отрешенности.',576,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(42,'Солнце почти театрально подсветило горную гряду над Солнечной долиной.',572,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(43,'Если с этой точки посмотреть на юг, на склон мыса Меганом, присмотревшись можно увидеть на его склоне электрогенерирующие ветряки. Внизу среди холмов виднеется небольшое пресноводное озеро Бугаз.',583,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(44,'Вот она - зима в Крыму, посмотрите.',560,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(45,'Может кто-то объяснить что это значит? Вообще тут много такого есть - магические алтари, лабиринты, следы инопланетян.',613,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(46,'Если посмотреть в другую сторону, на юг, можно увидеть совсем другой ландшафт, который при такой освещенности имеет немного нереальный вид. Вдали справа - мыс Меганом.',575,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(47,'На самом деле каменистых участков тут немного, почти всю площадь пляжей покрывает мелкая галька или песок.',561,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(48,'Различные цвета ягод винограда различных сортов и вин, из них сделанных, закономерно дополняются эффектным разнообразием листьев.  ',532,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(49,'Угол подъема не слишком крутой, вдали виднеются, чуть фиолетовые, соседние горы.',546,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(50,'Хорошо виден средний уровень высоты Крымских гор. Чуть далее за горами на снимке - уже Южный Берег, до Ялты от Судака всего около восьмидесяти километров по южной дороге. ',547,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(51,'С правой стороны - обширная Капсельская бухта. Теперь это также популярный загородный пляж, куда удобнее добираться на машине. Почти в центре находится гора Алчак. Виден Судак, характерный силуэт горы Сокол, а далее - бухты Нового Света. ',545,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(52,'Яркое пятно вдали привлекает внимание контрастом горячих желто-красных цветов с насыщенным зеленым и спокойным серым. ',531,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(53,'По сравнению с Большой Ялтой места близ Судака выглядят чуть не пустыней, но этот образ не менее своеобразен и интересен. ',548,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(54,'Различные цвета ягод винограда различных сортов и вин, из них сделанных, закономерно дополняются эффектным разнообразием листьев.  ',532,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(55,'Угол подъема не слишком крутой, вдали виднеются, чуть фиолетовые, соседние горы.',546,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(56,'Хорошо виден средний уровень высоты Крымских гор. Чуть далее за горами на снимке - уже Южный Берег, до Ялты от Судака всего около восьмидесяти километров по южной дороге. ',547,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(57,'С правой стороны - обширная Капсельская бухта. Теперь это также популярный загородный пляж, куда удобнее добираться на машине. Почти в центре находится гора Алчак. Виден Судак, характерный силуэт горы Сокол, а далее - бухты Нового Света. ',545,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(58,'Яркое пятно вдали привлекает внимание контрастом горячих желто-красных цветов с насыщенным зеленым и спокойным серым. ',531,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(59,'По сравнению с Большой Ялтой места близ Судака выглядят чуть не пустыней, но этот образ не менее с