 загородный пляж, куда удобнее добираться на машине. Почти в центре находится гора Алчак. Виден Судак, характерный силуэт горы Сокол, а далее - бухты Нового Света. ',545,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(70,'Яркое пятно вдали привлекает внимание контрастом горячих желто-красных цветов с насыщенным зеленым и спокойным серым. ',531,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(71,'По сравнению с Большой Ялтой места близ Судака выглядят чуть не пустыней, но этот образ не менее своеобразен и интересен. ',548,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(72,'Почти в центре видна дорога в Моское, до него на машине добираться не больше пяти минут.',562,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(73,'Виноградные кусты закреплены на проволке, натянутой на бетонные колья.',533,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(74,'Почти все работы по выращиванию виноградной лозы выполняются вручную.',534,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(75,'Со стороны Судака Меганом выглядит немного унылой и неинтересной глиняной глыбой. На самом деле на нем достаточно много растительности, есть масса красивых бухт и живописных скал. Просто все это можно увидеть, только пройдя по его многочисленным тропам. Но сейчас сделаем наоборот - бросим взгляд с Меганома на побережье к Судаку. ',544,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(76,'Идти по извилистой тропинке по жаре нелегко. но море прохладой наградит всех, кто осилит спуск.',511,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(77,'С этой точки видны пляжи Судака, а волнорезы внизу - это небольшой пляж в Уютном. Бывший поселок Уютное сейчас входит в состав Судака. Уютнинский пляж отделен от судакских пляжей Крепостной горой. ',527,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(78,'Вид с вершины горы Сокол на море. Конечно, снимок не может передать и часть реального впечатления от открывающегося простора.',524,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(79,'Кажется, горы подчинены некоторому ритму, который сложно выразить словами, но увидеть - возможно.',519,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(80,'Эта тропинка может привести Вас на самую вершину одной из красивейших гор Судака - Сокол.',521,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(81,'Бросим взгляд в сторону Судака. Внизу видна дорога из Нового Света, ниже которой располагаются каменистый берег. Далее еле видна в дымке Крепостная гора, на которой расположена известная Генуэзская крепость. Еще дальше виднеется прибрежная часть Судака. Закрывает Судакскую бухту с востока гора Алчак.',525,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(82,'На одном из поворотов тропинки между деревьями появилась Генуэзская, или Судакская, крепость. ',518,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(83,'На этих горах мы собирали грибы.',592,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(84,'Оптимистичность таких пейзажей подтверждена - многие люди осущают значительный душевный подъем в этих местах, который только усиливает прием хорошего местного вина.',512,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(85,'Вид на гору Сокол со стороны моря. внизу видна дорога из Судака в Новый Свет. ',508,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(86,'В трещинах сплошной каменной глыбы растут даже сосны.  ',526,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(87,'Тропинка ведет по довольно крутому склону, поросшему туями и можжевельником.',510,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(88,'Вид на противоположную от моря сторону. В отличии от Сокола, горы вокруг имеют намного более пологие склоны.',528,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(89,'Банально говорить, что в таких местах все мелкие неприятности города уходят из сознания человека, но это действительно так.',520,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(90,'Специфический приятный запах сосен и можжевельника, белые известковые скалы вокруг, бледнеющая синева далеких гор вдали - основные составляющие впечатлений этого места.',517,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(91,'Местные жители считают что гора Сокол \"притягивает\" к себе облака и тучи. Справа внизу видна заостренная скала под названием Чертов Палец.',507,'2009-10-05 00:00:00','2009-10-05 00:00:00',NULL,NULL),(92,'Почти все гуляющие включают в свой вечерний маршрут гороской причал.',651,'2010-02-22 13:12:18','2010-02-22 13:12:18',NULL,NULL),(93,'Желающие могут ночью совершить интересную морскую прогулку на одном из небольших теплоходов.',652,'2010-02-22 13:12:18','2010-02-22 13:12:18',NULL,NULL),(94,'Если пройти по берегу к крепости, то перед Вами откроется вид на всю Судакскую бухту. ',650,'2010-02-22 13:12:18','2010-02-22 13:12:18',NULL,NULL),(95,'Свет фонарей освещает часть пляжа и сложенные до утра лежаки и катамараны.',649,'2010-02-22 13:12:18','2010-02-22 13:12:18',NULL,NULL),(96,'На городском пляже возле причала.',648,'2010-02-22 13:12:18','2010-02-22 13:12:18',NULL,NULL),(98,'На пляже лежит тонкий слой снега, температура воздуха - минус три градуса. Для Судака это холодно.',712,'2010-03-02 08:15:17','2010-03-02 08:15:17',2,NULL),(100,'Городской причал пуст - зимой все теплоходы и катера находятся на берегу.',713,'2010-03-02 08:19:09','2010-03-02 08:19:09',2,NULL),(101,'Ледяные наросты на сваях - это все что может сделать мороз с соленой чёрноморской водой.',714,'2010-03-02 08:42:30','2010-03-02 08:42:30',2,NULL),(102,'Пустой городской пляж заняли лебеди. Этих красивых птиц жители города подкармливают и не обижают.',715,'2010-03-02 08:46:14','2010-03-02 08:46:14',2,NULL),(103,'Низкое зимнее солнце не может дать летней яркости красок. Горы, море и небо - везде спокойные мягкие тона.  ',716,'2010-03-02 08:53:10','2010-03-02 08:53:10',2,NULL),(104,'Пронзительно-голубое небо и коричнево-грязные волны можно наблядать в редкий ясный день зимой. ',705,'2010-03-02 09:30:28','2010-03-02 09:30:28',2,NULL),(105,'Волнорезы выполняют свою основную функцию - не дают волнам смыть песок с пляжей. ',706,'2010-03-02 09:33:11','2010-03-02 09:33:11',2,NULL),(106,'Волны легко накрывают весь пляж. Бывает что сильный шторм разрушает и часть набережной.',707,'2010-03-02 09:35:31','2010-03-02 09:35:31',2,NULL),(107,'тобы получить полное впечатление от такого шторма, его нужно слышать. Грохот волн и шум ветра вместе с летящими с моря солёными брызгами воды - обязательные составляющие такого, довольно сильного по местным меркам, шторма.',708,'2010-03-02 09:39:37','2010-03-02 09:39:37',2,NULL),(108,'Сильного шторма боятся и корабли. Сухогрузы в такое время стараются укрыться от непогоды в ближайших бухтах.',709,'2010-03-02 09:41:40','2010-03-02 09:41:40',2,NULL),(110,'На мысе видны развалины строжевой башни, из которой наблюдали за всеми проплывающими кораблями. ',699,'2010-03-02 10:27:38','2010-03-02 10:27:38',2,NULL),(111,'Крупные камни вносят разнообразие в плоскость мелкогалечного пляжа.',700,'2010-03-02 10:31:02','2010-03-02 10:31:02',2,NULL),(112,'Дорога на Алушту в этом месте проходит прямо по берегу.',701,'2010-03-02 10:33:19','2010-03-02 10:33:19',2,NULL),(113,'Дорога на Алушту проходит в основном в горах, и возможность подъехать к морю представится не часто.',702,'2010-03-02 10:37:47','2010-03-02 10:37:47',2,NULL),(114,'Почувствуйте ощущение простора и даже некоторой торжественности.\r\n\r\n',698,'2010-03-02 10:48:42','2010-03-02 10:48:42',2,NULL),(115,'Так близко к берегу и к людям эти птицы приближаются только зимой.',655,'2010-03-02 13:50:50','2010-03-02 13:50:50',2,NULL),(116,'Чайки - настоящие морские разбойники, заберут все у зазевавшейся или просто более мелкой птицы. ',656,'2010-03-02 13:52:31','2010-03-02 13:52:31',2,NULL),(117,'На этот раз лебеди держатся в отдалении, но бываю дни, когда они почти выходят на берег к людям. ',657,'2010-03-02 13:54:52','2010-03-02 13:54:52',2,NULL),(118,'С громкими криками чайки носятся над водой, и, высмотрев добычу, камнем бросаются на неё.',658,'2010-03-02 13:56:56','2010-03-02 13:56:56',2,NULL),(119,'Лебеди обычно держатся плотными группами, но иногда одна или две птицы держатся от стаи на большом расстоянии.  ',659,'2010-03-02 13:59:38','2010-03-02 13:59:38',2,NULL),(120,'Дайверам сюда лучше добираться на катере.',677,'2010-03-02 15:01:30','2010-03-02 15:01:30',2,NULL),(121,'Пляж достаточно далеко от города, поэтому людей тут обычно немного',678,'2010-03-02 15:03:15','2010-03-02 15:03:15',2,NULL),(122,'По сравнению с городским пляжем, здесь прямо нереальная чистота.',679,'2010-03-02 15:07:43','2010-03-02 15:07:43',2,NULL),(123,'Чем не средиземноморье? На этом снимке легко оценить прозрачность воды.',680,'2010-03-02 15:09:54','2010-03-02 15:09:54',2,NULL),(124,'Это конечно не кораллы, но, на мой взгляд, берег выглядит достаточно экзотично.',681,'2010-03-02 15:12:59','2010-03-02 15:12:59',2,NULL),(126,'Под самым мысом Меганом располагается довольно большой пляж. Рядом располагается выносная торговля есть и простые летние кафе.\r\n\r\n',691,'2010-03-02 15:39:34','2010-03-02 15:39:34',2,NULL),(127,'Тут можно примерно оценить расстояние до Судака - он находится перед большой горой слева снимка.',692,'2010-03-02 15:43:06','2010-03-02 15:43:06',2,NULL),(128,'Тут можно примерно оценить расстояние до Судака - он находится перед большой горой слева снимка.',692,'2010-03-02 15:45:35','2010-03-02 15:45:35',2,NULL),(129,'Виден посёлок Новый Свет, мыс Капчик слева и гора Сокол справа. ',693,'2010-03-02 15:48:19','2010-03-02 15:48:19',2,NULL),(130,'Так как людей здесь значительно меньше, чем отдыхает на городском пляже, вода тут намного чище.',694,'2010-03-02 15:51:20','2010-03-02 15:51:20',2,NULL),(131,'Вид сверху на Капсельскую долину. Снимок сделан осенью, трава желтая, и долина кажется самой настоящей пустыней. ',695,'2010-03-02 15:57:08','2010-03-02 15:57:08',2,NULL);
