INSERT INTO `entries` VALUES (20,1,'Про концерты','В разгар сезона в Судак приезжают многие российские и украинские звезды. Причем в основном - самые раскрученные и известные, ведь другие просто не смогут собрать зал из самой разношерстной в национальном и культурном отношении приезжей публики. \r\nПостоянно радуют своих поклонников Филип Киркоров, Кристина Орбакайте, Валерий Меладзе. Частенько в последние годы бывают Григорий Лепс, Валерий Леонтьев и Борис Моисеев. И конечно каждое лето приезжают разные команды КВН. \r\nПостоянных гастролеров разбавляет большое количество других исполнителей, в том числе и юмористов. В августе обычно концерты проходят через каждые пару дней, а то и ежедневно.\r\nНекоторые высказывают мнение, что в таких небольших городах артисты что называется \"халтурят\". По своему опыту замечу, что хотя билеты тут обычно стоят значительно меньше чем в крупных городах на тех-же артистов, качество выступлений зависит только от самого исполнителя. \r\nВ последнее время халтуры почти нет. Ну разве в последнее лето люди ругали Потапа и Настю Камеских, хотя я сам на них не ходил. \r\nХодил, например, на Валерия Меладзе - только хорошее могу сказать, не волынил. Еще на Ани Лорак - тут одни восторги, хоть и билеты были дороговаты немного, все-равно жалею, что не купил места поближе, шоу того стоило.\r\nЛетом на сайте будет представлена информация о планируемых гастролях и других значительных событиях. Например - джазовом  фестивале в Коктебеле. Но про это напишу отдельно. ',0,'2010-02-09 09:17:34','2010-02-15 19:02:15',1,'ru'),(21,1,'Прошедший джазовый фестиваль Live in Blue Bay','4-6 сентября в Коктебеле прошел джазовый фестиваль Live in Blue Bay. Сначала хочу заметить что от Судака до Коктебеля на машине около 40 минут езды на машине по извилистой, не совсем ровной, но очень живописной горной дороге. Так что при желании попасть в Коктебель - а Коктебель сам по себе место очень интересное - не составит никакого труда. \r\nПро сам фестиваль. Случайно попался сайт в интернете о фестивале http://www.bluebayjazz.com/ \r\nПричислить себя к знатокам джаза не могу, но джаз люблю и слушаю. Поэтому, прочитав состав участников, решил обязательно посетить фестиваль. \r\nПрихватив теплые куртки, едем 4-го сентября в Коктебель. Куртки нужны потому, что хотя днем в начале сентября в Крыму может быть жарко, ночью осень подступает ближе, и в летней одежде до конца программы в 12 часов ночи можно и не достоять. \r\nПо прибытию сразу ощутили особую атмосферу Коктебеля, где всегда отдыхает большое количество самой различной творческой, околотворческой, сочувствующей и просто неформальной (самой широкой гаммы неформальности) публики. \r\nНа сцене завершали последние приготовления, настраивали аппаратуру, кто-то распевался. Так как плата за вход не бралась, к открытию подтянулось много людей. Причем сразу было заметно, что у некоторых из них слово \"джаз\" ассоциируется только с фильмом \"В джазе только девушки\". \r\nПрограмма длилась с 8-ми вечера до 12-ти часов ночи, поэтому такая публика отсеялась первой. Было много молодежи, как любителей джаза, так и просто ищущих места где напиться. \r\nСперва небольшая официальная часть, потом начался концерт. \r\nЧто сказать - если и были в первый день небольшие организаторские шероховатости, они были полность компенсированы артистами. Мне понравились почти все нсполнители, правда на третий день мы не смогли приехать. Особенно раскачали публику Сергей Манукян и Алексей Архиповский, а про Энвера Измайлова и Нино Катамадзэ вообще нечего говорить - это звезды мирового уровня. \r\nАртисты, как и сам джаз, были очень разными, и те, кто смог выстоять все 4 часа программы, получили массу печатлений. Это вообще очень правильная мысль - проводить фестивали джаза в Коктебеле, само место располагает к такой музыке, с этим, я думаю, согласятся многие. \r\nДомой ехали уже ночью, дорога пустая, даже в горах, если не гнать и не пить за рулем, проблем добраться не будет. Хотя вполне возможно остаться на пару дней в самом Коктебеле, тоже не пожалеете.\r\n ',0,'2010-02-11 15:00:48','2010-02-15 19:00:27',1,'ru'),(22,1,'Про местные вина','Приехать на крымское побережье и не попробовать крымского вина - хоть много, хоть чуть-чуть - значит не получить существенную часть общего Впечатления от Крыма. В это Впечатление входит все, что люди увозят обратно -  в Москву или Новоград-Волынский. \r\nОчень часто причиной того, что этот багаж оставляет желать лучшего, являются довольно распространенные стереотипные заблуждения. Мне то и дело приходилось слышать - \"Вот приехали в Крым, нужно купить НАСТОЯЩЕГО крымского вина\", и идут на набережную и покупают с рук подкрашенный шелковицей раствор спирта с водой в пластиковых бутылках. Ну, или, в лучшем случае, недоброженное или перестоянное молодое вино с сахаром. \r\nК моим настойчивым советам покупать вино только в магазинах, эти люди относятся очень подозрительно, ведь, по их мнению, вино в магазинах ненастоящее. \r\nЭто правда. Большинство марок вина в магазинах - порошковый суррогат, а местные действительно делают настоящее вино. Только вот приезжим они его продают редко, и то только если вино неудачное. Если вино хорошее его обычно выпивают сами или пристраивают родственникам. \r\nЧто делать? Я могу посоветовать покупать то, что покупают местные. Это вино местных винзаводов торговых марок \"Массандра\" и \"Солнечная Долина\". Первое лучше, второе дешевле - в среднем конечно. \r\nВозможно, Вы сейчас подумаете - вот опять скрытую рекламу продвигают. Что мне сказать, можете не верить. А можете поверить и устранить одну крупную потенциальную проблему, которая может испортить Ваш, такой долгожданный, отпуск в Крыму. \r\nЭти вина хоть и не равны качественным европейским и южноамериканским, но, по крайней мере, делались не из порошка и не отравят (в разумных дозах). А вот добавить положительных эмоций - обязательно добавят, ведь виноград, из которого они сделаны, растет прямо здесь, на полях вокруг Судака. \r\nДумаю еще нужно расписать по названиям вин, но это в другой раз.',0,'2010-02-11 16:08:33','2010-02-15 18:58:11',1,'ru'),(23,1,'Черное море и Айвазовский','В Феодосии находится картинная галерея великого мариниста Ивана Константиновича Айвазовского. Я очень рекомендую ее посетить, ведь из Судака до Феодосии всего около часа езды на машине. \r\nДля тех людей, которые живописью интересуются, так скажем, периодически, замечу, что впечатление от картины непосредственно на стене может очень сильно отличаться от расмматривания этой картины в репродукции. \r\nК картинам Айвазовского это относится в полной мере - его картины действительно грандиозны. В залах галереи Вы сможете увидеть огромные полотна, буквально излучающие на зрителя образ Моря - прекрасного, страшного и манящего. \r\nМногие художники пытались и пытаются достичь такой красоты и эффектности в своих полотнах, еще больше картины Айвазовского критиковали и критикуют за \"театральность\" и псевдореализм. Кажется - вот оно настоящее море, однако, любой кто прожил достаточно долгое время на побережье, подтвердит, что в реальности такого моря не бывает. Никогда. И не было. \r\nНо какое это имеет значение, если каждое полотно - это целая театральная постановка со своей историей, эффектным сюжетом и будущей развязкой? Не стоит сравнивать произведение искусства с фотографическим реализмом. Посмотрите.',1,'2010-02-11 17:17:45','2010-02-15 18:56:31',1,'ru'),(24,1,'Что лучше - отдыхать \"дикарем\" или по путевке? ','Тема, я думаю, интересует многих. Каждый из способов имеет много существенных плюсов и столько-же не менее существенных минусов. \r\nОтдохнуть хорошо можно в обоих случаях, все зависит от Ваших предпочтений.  Определитесь с тем что Вам ближе, что Вы любите делать на отдыхе, каковы, так сказать, планы минимум и максимум, а также какими средствами Вы располагаете и выбор станет очевидным. \r\nПреимущества дикого отдыха - дешевизна, большой выбор предложений буквально на любой вкус, полная самостоятельность в принятии решений и в ответственности за их реализацию. \r\nНедостатки - неопределенность как обратная сторона свободы может привести как к прекрасным, так и, к сожалению, негативным результатам. В этом случае все будет зависеть именно от Вас - от Вашего выбора маршрута, места проживания, решения бытовых вопросов, способности находить все самое лучшее за Ваши деньги. Никто думать за Вас не будет. \r\nПоэтому я могу рекомендовать \"дикий\" отдых только людям самостоятельным, способным не растерятся в сложных ситуациях, стопроцентно знающим что именно им нужно и, желательно. с опытом подобного отдыха. Ну или хотя-бы собравшим по-максимуму информацию про желаемое место проведения отпуска. \r\nДля тех, кто предпочитает отдых в более классическом его понимании - максимум отдыха и минимум действия, неорганизованный отдых гарантированный результат дать не может. Тут все будет зависеть от везения. \r\nЕсли средства позволяют, таким людям лучше приобрести путевку в здравницу или хороший частный пансионат. В этом случае количество возможных проблем сильно уменьшается, отдых проходит организованно и предсказуемо, и, обычно, более комфортно. В общем, я думаю, все очевидно. \r\nИ еще маленький совет - если Вы едете в какое-то место впервые, не поленитесь поспрашивать о нем у знакомых или поискать информацию в интернете. Имейте ввиду, что предложения по одной цене далеко не всегда равнозначны по качеству услуг, это типично для всего постсоветского сервиса в целом, и для крымского в частности.      ',0,'2010-02-11 17:58:57','2010-02-15 19:09:52',1,'ru'),(27,1,'Джазовый фестиваль Live in Blue Bay  ','4-6 вересня в Коктебелі пройшов джазовий фестиваль Live in Blue Bay. Спочатку хочу зазначити що від Судака до Коктебеля на машині близько 40 хвилин їзди на машині по звивистій, не зовсім рівній, але дуже мальовничій гірській дорозі. Так що при бажанні потрапити в Коктебель - а Коктебель сам по собі місце дуже цікаве - не важко.\r\nПро сам фестиваль. Випадково попався сайт в інтернеті http://www.bluebayjazz.com/ \r\nЗарахувати себе до знавців джазу не можу, але джаз люблю і слухаю. Тому, прочитавши склад учасників, вирішив обов\'язково відвідати поїхати. \r\nПрихопивши теплі куртки, їдемо 4-го вересня в Коктебель. Куртки потрібні тому, що хоча вдень на початку вересня в Криму може бути жарко, вночі осінь підступає ближче, і в літньому одязі до кінця програми о 12 годині ночі можна і не достояти. \r\nПо прибуттю відразу відчули особливу атмосферу Коктебеля, де завжди відпочиває велика кількість всілякої творчої, навколотворчих, співчуваючої і просто неформальній (самої широкої гами неформальність) публіки. \r\nНа сцені завершували останні приготування, налаштовували апаратуру, хтось співав. Так як плата за вхід не бралася, до відкриття підтягнулося багато людей. Причому відразу було помітно, що у деяких з них слово \"джаз\" асоціюється тільки з фільмом \"У джазі тільки дівчата\". \r\nПрограма тривала з 8-ї вечора до 12-ї години ночі, тому така публіка відсіялися першою. Було багато молоді, як любителів джазу, так і просто шукаючих місця де напитись. \r\nСпершу невелика офіційна частина, потім почався концерт. \r\nЩо сказати - якщо і були в перший день невеликі організаторські шорсткості, вони були повністю компенсовані артистами. Мені сподобалися майже всі виконавці, правда на третій день ми не змогли приїхати. Особливо розгойдали публіку Сергій Манукян та Олексій Архиповський, а про Енвера Ізмайлова і Ніно Катамадзе взагалі нема чого казати - це зірки світового рівня. \r\nАртисти, як і сам джаз, були дуже різними, і ті, хто зміг вистояти всі 4 години програми, отримали масу вражень. Це взагалі дуже правильна думка - проводити фестивалі джазу в Коктебелі, саме це місце створене для такої музики. З цим, я думаю, погодяться ті, хто тут відпочивав.\r\nДодому їхали вже вночі, дорога порожня, навіть в горах, якщо не гнати й не пити за кермом, проблем добратися не буде. Хоча цілком можливо залишитися на пару днів в самому Коктебелі, теж не пошкодуєте',0,'2010-02-27 19:58:10','2010-02-27 20:12:30',1,'uk'),(28,1,'Що краще - відпочивати \"дикуном\" або по путівці?','Тема, я думаю, цікавить багатьох. Кожен із способів має багато суттєвих плюсів і стільки-ж не менш істотних мінусів. \r\nВідпочити можна добре в обох випадках, все залежить від Вашої натури. Визначтеся з тим що Вам ближче, що Ви любите робити на відпочинку, які, так би мовити, плани мінімум і максимум, а також які ресурси Ви маєте в своєму розпорядженні і вибір стане очевидним. \r\nПереваги дикого відпочинку - дешевизна, великий вибір пропозицій буквально на будь-який смак, повна самостійність у прийнятті рішень і у відповідальності за їх реалізацію. \r\nНедоліки - невизначеність як зворотний бік свободи може призвести як до прекрасних, так і, на жаль, негативних результатів. У цьому випадку все буде залежати саме від Вас - від Вашого вибору маршруту, місця проживання, вирішення побутових питань, здатності знаходити все найкраще за Ваші гроші. Ніхто думати за Вас не буде. \r\nТому я можу рекомендувати \"дикий\" відпочинок тільки людям самостійним, здатним не розгубитися в складних ситуаціях, стовідсотково знаючих що саме їм потрібно і, бажано. з досвідом подібного відпочинку. Ну або хоча-б зібрати по-максимуму інформацію про бажане місце проведення відпустки. \r\nДля тих, хто віддає перевагу відпочинок у більш класичному його розумінні - максимум відпочинку і мінімум дії, неорганізований відпочинок гарантований результат дати не може. Тут все буде залежати від везіння. \r\nЯкщо кошти дозволяють, таким людям краще придбати путівку в здравницю або хороший приватний пансіонат. У цьому випадку кількість можливих проблем різко зменшується, відпочинок проходить організовано і передбачувано, і, звичайно, більш комфортно. Загалом, я думаю, все очевидно. \r\nІ ще маленька порада - якщо Ви їдете в якесь місце вперше, не полінуйтеся розпитати про нього у знайомих або пошукати інформацію в інтернеті. Майте на увазі, що пропозиції по одній ціні далеко не завжди рівнозначні за якістю послуг, це типово для всього пострадянського сервісу в цілому, і для кримського зокрема.',0,'2010-02-27 20:03:40','2010-02-27 20:14:10',1,'uk'),(29,1,'Чорне море і Айвазовський','У Феодосії знаходиться картинна галерея великого мариніста Івана Костянтиновича Айвазовського. Я дуже рекомендую її відвідати, адже з Судака до Феодосії лише близько години їзди на машині. \r\nДля тих людей, які цікавляться живописом, так скажемо, періодично, зазначу, що враження від картини безпосередньо на стіні може дуже сильно відрізнятися від прсмотру цієїж картини в репродукції. \r\nДо картин Айвазовського це відноситься повною мірою - його картини дійсно грандіозні. У залах галереї Ви зможете побачити величезні полотна, що буквально випромінюють на глядача образ Моря - прекрасного, грізного, привабливого. \r\n\r\n\r\nБагато митців намагалися і намагаються досягти такої краси і ефектності на своїх полотнах. Ще більше картини Айвазовського критикували і критикують за \"театральність\" та псевдореалізм. Здається - ось воно справжнє море, однак, ті хто прожив досить довгий час на узбережжі, підтвердить, що в дійсності такого моря не буває. Майже ніколи. Певно і не було. \r\nАле яке це має значення, якщо кожне полотно - це ціла театральна постановка зі своєю історією, ефектним сюжетом і майбутньої розв\'язкою? Не варто порівнювати витвір мистецтва з фотографічною реалізмом. Подивіться.',0,'2010-02-27 20:19:36','2010-02-27 20:19:36',1,'uk'),(30,1,'Про місцеві вина','Приїхати на кримське узбережжя і не спробувати кримського вина - хоч багато, хоч трохи - значить не отримати істотну частину загального Враження від Криму. В це Враження входить все, що люди відвозять назад - у Москву чи, скажемо, Новоград-Волинський. \r\nДуже часто причиною того, що цей багаж залишає бажати кращого, є досить поширені стереотипні помилки. Мені раз у раз доводилося чути - \"Ось приїхали до Криму, потрібно купити справжнього кримського вина\", і йдуть на набережну і купують з рук підфарбований шовковицею розчин спирту з водою в пластикових пляшках. Ну, або, у кращому випадку, недоброженное або перестояне молоде вино з цукром. \r\nДо моїх наполегливих порад купувати вино тільки в магазинах, ці люди ставляться дуже підозріло, адже, на їхню думку, вино в магазинах несправжнє. \r\nЦе правда. Більшість марок вина в магазинах - порошковий сурогат, а місцеві дійсно роблять справжнє вино. Тільки от приїжджим вони його продають рідко, і то тільки якщо вино невдале. Якщо вино добре його зазвичай випивають самі або прилаштовують родичам. \r\nЩо робити? Я можу порадити купувати те, що купують місцеві. Це вино місцевих винзаводів торгових марок \"Масандра\" та \"Сонячна Долина\". Перше краще, другий дешевше - у середньому звичайно. \r\nМожливо, Ви зараз подумаєте - ось знову приховану рекламу просувають. Що мені сказати, можете не вірити. А можете повірити і усунути одну велику потенційну проблему, яка може зіпсувати Ваш, такий довгоочікуваний, відпочинок в Криму. \r\nЦі вина хоч і не рівні якісним європейським і південноамериканським, але, принаймні, робилися не з порошку і не отруять (в розумних дозах). А от додати позитивних емоцій - обов\'язково додадуть, адже виноград, з якого вони зроблені, росте прямо тут, на полях навколо Судака. \r\nДумаю ще потрібно розписати за назвами вин, але це іншим разом.',0,'2010-02-27 20:24:32','2010-02-27 20:24:32',1,'uk'),(31,1,'Про концерти','У розпал сезону в Судак приїжджають багато російських та українських зірок. Причому в основному - самі розкручені і відомі, адже інші просто не зможуть зібрати зал з самої різношерстої в національному та культурному відношенні курортної публіки. \r\nПостійно радують своїх шанувальників Філіп Кіркоров, Крістіна Орбакайте, Валерій Меладзе. Часто в останні роки бувають Григорій Лепс, Валерій Леонт\'єв та Борис Моісеєв. І, звичайно, кожне літо приїжджають різні команди КВН. \r\nПостійних гастролерів розбавляє велика кількість інших виконавців, у тому числі і гумористів. У серпні зазвичай концерти проходять через кожні пару днів, а то й щодня. \r\nДеякі висловлюють думку, що в таких невеликих містах артисти що називається \"халтурять\". З власного досвіду зазначу, що хоча квитки тут зазвичай коштують значно менше ніж у великих містах на тих самих артистів, якість виступів залежить тільки від самого виконавця. \r\nОстаннім часом халтури майже немає. Ну хіба в останнє літо люди лаяли Потапа і Настю Камескіх, хоча я сам на них не ходив. \r\nХодив, наприклад, на Валерія Меладзе - тільки добре можу сказати, викладався. Ще на Ані Лорак був - тут одне захоплення, хоч і квитки були занадто дорогими трохи, все-одно шкодую, що не купив місця ближче, шоу було того варте. \r\nВлітку на сайті буде надана інформація про плановані гастролі і інші значні події. Наприклад - про джазовий фестиваль у Коктебелі. Але про це напишу окремо.',0,'2010-02-27 20:30:43','2010-03-05 08:20:31',1,'uk');
