INSERT INTO `forums` VALUES (6,'О Судаке и окрестностях','Темы, связанные с самим городом, вопросы месторасположения, географические.','2009-11-10 15:36:10','2009-12-05 17:20:52',1,'ru'),(7,'Море, пляжи','Все что касается Черного моря. ','2009-11-10 15:43:13','2009-12-05 17:21:07',2,'ru'),(8,'Питание','Одна из самых важных тем.','2009-11-11 07:31:23','2009-12-05 17:21:39',2,'ru'),(9,'Развлечения','Вопросы о том, что может предложить Судак для интересного времяпровождения гостей. ','2009-12-05 17:12:01','2009-12-05 17:21:56',1,'ru'),(10,'\"Дикий\" отдых','Для любителей естественной жизни.','2009-12-05 17:13:08','2009-12-05 17:22:13',2,'ru'),(11,'Место проживания','Все что связано с гостиницами, пансионатами, частным сектором. В объявлениях о сдаче жилья указание улицы - обязательно. ','2009-12-05 17:14:46','2010-04-26 17:15:45',1,'ru'),(12,'Туристический','Для любителей путешествий.','2009-12-05 17:16:51','2009-12-05 17:22:49',3,'ru'),(13,'Контакты','Для завязывания или поддержания интересных знакомств.','2009-12-05 17:18:57','2009-12-05 17:23:06',0,'ru'),(14,'Разное','Для того что не подошло в другие категории.','2009-12-05 17:20:07','2009-12-05 17:23:22',0,'ru'),(15,'Про Судак та околиці','Теми, пов\'язані з самим містом, питання місця розташування, географічні','2010-02-26 09:20:56','2010-02-26 09:20:56',0,'uk'),(16,'Море, пляжі','Все що стосується Чорного моря.','2010-02-26 09:53:27','2010-02-26 09:53:27',0,'uk'),(17,'Харчування','Одна з найважливіших тем.','2010-02-26 09:54:34','2010-02-26 09:54:34',0,'uk'),(18,'Розваги','Питання про те, що може запропонувати Судак для цікавого проведення часу гостей.','2010-02-26 09:55:57','2010-02-26 09:55:57',1,'uk'),(19,'\"Дикий\" відпочинок','Для любителів природного життя.','2010-02-26 09:57:43','2010-02-26 09:57:43',2,'uk'),(20,'Місце проживання','Все що пов\'язано з готелями, пансіонатами, приватним сектором.','2010-02-26 09:58:53','2010-02-26 09:58:53',1,'uk'),(21,'Туристичний','Для любителів подорожей.','2010-02-26 10: