INSERT INTO `posts` VALUES (68,36,15,'Кто отдыхал с машиной возле Морского, там есть два пляжа хороших говорят? Поделитесь впечатлениями.','2010-02-11 18:23:03','2010-02-11 18:23:03'),(69,37,15,'Слышал в судаке есть аквапарк. Стоит посетить?','2010-02-11 18:31:16','2010-02-11 18:31:16'),(70,38,15,'Думаю приехать с девушкой на майские праздники в Судак. Вот в инете нарыл Горизонт - какой у кого опыт?','2010-02-11 18:33:29','2010-02-11 18:33:29'),(71,39,15,'Народ кто знает как лучше (не на такси) добраться до сабжа','2010-02-11 18:36:06','2010-02-11 18:36:06'),(72,40,15,'Можно ставить палатки в Новом Свете, хотим поехать, место там красивое','2010-02-11 18:38:21','2010-02-11 18:38:21'),(73,40,1,'Там ботанический заказник, это как заповедник, палатки ставить там нельзя. За этим строго следят. Можно поехать на кемпинг возле Меганома - там не так как в Новом Свете, но отдохнуть можно.','2010-02-11 18:41:22','2010-02-11 18:41:22'),(74,36,1,'Место действительно очень хорошее - красиво, пляж хороший песчаный. Правда сам с машиной там не стоял. ','2010-02-11 18:44:41','2010-02-11 18:44:41'),(75,39,1,'Из Судака на автобусе до поселка Солнечная Долина, там пешком пару километров.','2010-02-11 18:47:04','2010-02-11 18:47:04'),(80,45,15,'I have heard about water park in Sudak. Worth a visit?','2010-02-26 13:26:28','2010-02-26 13:26:28'),(81,46,15,'Сan I put up tents in the New World? We want to go there, a place where beautiful.','2010-02-26 13:39:14','2010-02-26 13:39:14'),(82,46,15,'There is botanical reserve. Tents should not be put there. Foresters followed strictly for this. You can go to camp near Meganom - there is not so beautiful as in the Noviy Svet, but you can rest well.','2010-02-26 14:13:53','2010-02-26 14:13:53'),(83,47,15,'Who rested with a car near the Morske? Two beach there is, it\'s true? Share your experiences please.','2010-02-26 14:18:26','2010-02-26 14:18:26'),(84,47,15,'This place is really very good - nice, nice sandy beach. But I\'m not standing there with a car.','2010-02-26 14:21:21','2010-02-26 14:21:21'),(85,48,15,'I want to come in Sudak on May holidays with my girlfriend. Found on the Internet hotel Gorizont. What is the experience?','2010-02-26 14:25:50','2010-02-26 14:25:50'),(86,49,15,'People! Who knows how much better (not on taxi) to get to the topic?','2010-02-26 14:29:35','2010-02-26 14:29:35'),(87,50,15,'Чув в Судаку є аквапарк. Варто відвідати?','2010-02-26 17:38:43','2010-02-26 17:38:43'),(88,51,15,'Чи можна ставити намети в Новому Світі? Хочемо поїхати, місце там гарне.','2010-02-26 17:43:02','2010-02-26 17:43:02'),(89,51,1,'Там ботанічний заказник, це як заповідник, намети ставити там не можна. За цим суворо стежать. Можна поїхати на кемпінг біля Меганома - там не так як в Новому Світі, але відпочити можна.','2010-02-26 17:46:29','2010-02-26 17:46:29'),(90,52,15,'Хто відпочивав з машиною біля Морського, там є два пляжі хороших говорять? Поділіться враженнями.','2010-02-26 17:48:35','2010-02-26 17:48:35'),(91,52,15,'Місце дійсно дуже гарне - красиво, хороший пляж піщаний. Правда сам з машиною там не стояв.','2010-02-26 17:49:50','2010-02-26 17:49:50'),(92,53,15,'Думаю приїхати з дівчиною на травневі свята в Судак. Вот в інеті нарив Горизонт - який у кого досвід?','2010-02-26 17:51:55','2010-02-26 17:51:55'),(93,54,15,'Народ хто знає як краще (не на таксі) дістатися до сабжу','2010-02-26 17:54:40','2010-02-26 17:54:40'),(94,54,1,'З Судака на автобусі до селища Сонячна Долина, там пішки пару кілометрів.','2010-02-26 17:55:55','2010-02-26 17:55:55'),(95,37,15,'Есть хорошие горки, нам понравилось.','2010-04-07 14:20:33','2010-04-07 14:20:33'),(96,55,15,'Хотим поехать в Крым на машине. Слышали что дорога между Судаком и Ялтой сложная. Кто ездил, поделитесь.','2010-04-13 06:58:52','2010-04-13 06:58:52'),(97,55,15,'Дорога из Судака на Алушту и Ялту проходит вдоль берега моря и по Крымским горам. Это типичная горная дорога со множеством подъёмов, серпантинов и крутых поворотов. Но летом проехать по неё несложно, зато можно увидеть множество красивых крымских пейзажей. ','2010-04-13 07:03:37','2010-04-13 07:03:37'),(98,37,15,'нормально','2010-04-13 07:06:11','2010-04-13 07:06:11'),(99,56,15,'Где можно возле Судака поплавать с аквалангом?','2010-04-13 07:08:34','2010-04-13 07:08:34'),(100,39,15,'Ещё можно из Курортного пешком вдоль берега. Только оно вам нужно, люди? :)))','2010-04-13 07:10:13','2010-04-13 07:10:13'),(101,57,15,'То есть чтоб самим можно было готовить?','2010-04-13 07:12:28','2010-04-13 07:12:28'),(102,58,15,'Можно организовать поход в горы с проводником?','2010-04-13 07:14:44','2010-04-13 07:14:44'),(103,38,15,'ничего, только совковый немного','2010-04-13 07:19:52','2010-04-13 07:19:52'),(104,59,15,'Когда уже купаться можно???','2010-04-13 07:22:35','2010-04-13 07:22:35'),(105,55,1,'Едьте по южной дороге - не пожалеете. Если Вы совсем боитесь гор, тогда можно добраться из Судака в Ялту через Симферополь. ','2010-04-13 07:50:25','2010-04-13 07:50:25'),(106,59,1,'Море обычно прогревается к началу-середине июня. Но каждый год бывает по-разному, трудно сказать наперёд. Иногда в конце мая уже можно купаться, но такое бывает редко.','2010-04-13 08:00:39','2010-04-13 08:00:39'),(107,57,1,'Конечно можно, только этот момент заранее нужно обговорить с хозяевами. ','2010-04-13 08:02:46','2010-04-13 08:02:46'),(108,58,1,'Предлагаются походы с проводником как по окрестным местам так и по другим известным маршрутам - потухший вулкан Кара-Даг, Димерджи и множество других.','2010-04-13 08:06:29','2010-04-13 08:06:29'),(109,56,1,'Интересных мест много - Меганом, Новый Свет, Весёлое. Главное чтобы погода не подвела - море не штормило и вода была чистая.','2010-04-13 08:09:17','2010-04-13 08:09:17'),(110,60,15,'Есть информация - какой сейчас выбор среди кафе, ресторанов и тп?','2010-04-26 16:40:36','2010-04-26 16:40:36'),(111,60,15,'Обычно на майские открываются не все кафе и рестораны, но найти подходящий по качеству и цене - вполне реально. На Кипарисовой аллее всегда в это время работают несколько неплохих точек.','2010-04-26 16:43:10','2010-04-26 16:43:10'),(112,58,15,'Поблизости Судака рекомендую маршруты - горы Сокол, Перчем, Ай-Георгий, чуть дальше - мыс Меганом. Главный совет - берите удобную обувь.','2010-04-26 16:47:00','2010-04-26 16:47:00'),(113,61,15,'Как на пляже - можно уже валяться в раздетом виде? ','2010-04-26 16:49:32','2010-04-26 16:49:32'),(114,61,15,'На 26 апреля темпретура воздуха в Судаке 14-16 градусов, в тихих местах может быть 18-20. загорать в принципе вполне возможно, только нужно выбирать защищённые от ветра пляжи.','2010-04-26 16:56:20','2010-04-26 16:56:20'),(115,61,1,'Можно, но без фанатизма.','2010-04-26 17:01:54','2010-04-26 17:01:54');
/*!40000 ALTER TABLE `posts` ENABLE KEYS */;
