INSERT INTO `questions` VALUES (3,'Сколько времени добираться из Симферополя в Судак?','На машине дорога занимает чуть более часа, на автобусе - примерно полтора часа.',2,'2009-11-30 11:41:31','2009-11-30 11:44:35',1,'ru'),(4,'Есть в Судаке бесплатные пляжи?','Есть. Без оплаты можно отдыхать на центральном пляже а также на городском пляже под крепостью.',2,'2009-11-30 11:46:09','2009-11-30 11:47:25',1,'ru'),(5,'Трудно в августе найти недорогое жилье в частном секторе?','Конечно именно в августе наибольший спрос на жилье для отдыхающих. Но в последние годы это уже не такая проблема как ранее. ',2,'2009-11-30 11:48:13','2009-11-30 11:50:12',1,'ru'),(6,'Какая температура воды в Черном Море на Новый Год?','Обычно в середине зимы температура моря возле Судака находится в пределах 8-10 градусов.',1,'2010-02-11 16:18:21','2010-02-11 16:21:26',1,'ru'),(7,'Сдается-ли жилье в частном секторе в межсезонье?','С ноября по апрель в частном секторе найти жилье довольно трудно, ведь почти все номера построены исключительно для летнего использования. Если Вы хотите получить конкретные адреса, свяжитесь с менеджером сайта. ',2,'2010-02-11 16:30:52','2010-02-11 16:35:44',1,'ru'),(8,'Скільки часу добиратися з Сімферополя до Судака?','На машині дорога займає трохи більше години, на автобусі - приблизно півтори години.',15,'2010-02-27 09:21:42','2010-02-27 09:30:22',1,'uk'),(9,'Чи є в Судаку безкоштовні пляжі?','Без оплати можна відпочивати на центральному пляжі а також на міському пляжі під фортецею.',15,'2010-02-27 09:22:56','2010-02-27 16:13:27',1,'uk'),(10,'Важко в серпні знайти недороге житло в приватному секторі?','Звичайно саме в серпні найбільший попит на житло для відпочиваючих. Але в останні роки це вже не така проблема як раніше.',15,'2010-02-27 09:24:02','2010-02-27 16:14:32',1,'uk'),(11,'Яка температура води в Чорному Морі на Новий Рік?','Зазвичай в середині зими температура моря біля Судака знаходиться в межах 8-10 градусів.',15,'2010-02-27 09:25:12','2010-02-27 16:15:31',1,'uk'),(12,'Здається житло в приватному секторі в міжсезоння?\r\n\r\n','З листопада по квітень у приватному секторі знайти житло досить важко, адже майже всі номери побудовані виключно для літнього використання. Якщо Ви хочете отримати конкретні адреси, зв\'яжіться з менеджером сайту.',15,'2010-02-27 09:26:31','2010-02-27 16:16:30',1,'uk'),(13,'Can I rent a house in private sector on offseason?','It is difficult to find house in the private sector from November to April. Almost all the rooms are built solely for summer use. If you want to get specific addresses, contact the site manager',2,'2010-02-27 16:34:34','2010-04-02 06:33:41',1,'en'),(14,'What is the temperature of water in the Black Sea on New Year?','Usually in the middle of winter sea temperature near Sudak is within 8-10 degrees.',2,'2010-02-27 16:42:59','2010-02-27 16:43:49',1,'en'),(15,'Is it difficult to find affordable housing in the private sector in August?','The greatest demand for housing for holidaymakers in August. But in recent years is no longer a problem as before.',2,'2010-02-27 16:46:28','2010-04-02 06:31:19',1,'en'),(16,'Is there in Sudak free beaches?','You can relax without payment on the central beach and at the beach under the castle.',2,'2010-02-27 16:51:25','2010-02-27 16:58:49',1,'en'),(17,'How long is to travel from Simferopol to Sudak?','By car it takes just over an hour, by bus - about 40 minutes longer.',2,'2010-02-27 16:53:09','2010-02-27 16:55:15',1,'en'),(18,'Тепло будет в Судаке на майские праздники?','Обычно весна в Судаке прохладная. Море в начале мая ещё не прогревается, но в остальном - тепло, можно прекрасно отдохнуть. ',15,'2010-04-07 09:01:52','2010-04-08 15:19:03',1,'ru'),(19,'Будут на майские в Судаке экскурсии?','Будут обязательно. Возможно, меньше вариантов чем в разгар сезона, но выбор всё-равно будет.',15,'2010-04-11 16:36:13','2010-04-11 16:39:03',1,'ru'),(20,'Сколько стоит добраться из Симферополя до Судака?','На автобусе стоимость билета около 30-ти гривен (3,5 доллара), на такси - как договоритесь. С таксистами торг уместен, не соглашайтесь на первое-же предложение.',15,'2010-04-13 06:35:11','2010-04-13 06:43:41',1,'ru'),(21,'В какой месяц лучше отдыхать с ребёнком?','Если ребёнок маленький, лучше приезжать в начале или в конце сезона - до первой половины июля или со второй половины августа. В разгар сезона в Крыму обычно очень жарко, и многие дети плохо эту жару переносят. ',15,'2010-04-13 06:36:55','2010-04-13 06:49:30',1,'ru'),(22,'Сколько будут стоить недорогие номера в Судаке с 1-го мая?','Стоимость номеров зависит от предлагаемых условий и удалённости от моря. На эконом вариант расчитывайте примерно 30-50 грн. (4-6 долларов) за место без питания.',15,'2010-04-13 06:39:03','2010-04-13 06:53:28',1,'ru'),(23,'Куда из Судака можно поехать на экскурсию на корабле?','Предлагаются экскурсии морем в Ялту, Коктебель, Новый Свет, к вулкану Кара-Даг.',15,'2010-04-13 06:40:18','2010-04-13 06:55:31',1,'ru'),(24,'Какие улицы Судака самые популярные у отдыхающих?','Самые популярные конечно те улицы, которые ближе всего к морю. Это Морская, Бирюзова, Пограничников, Спендиарова и район аквапарка - ближняя к морю сторона улицы Гагарина. Там наибольшее количество больших  и маленьких пансионатов и гостиниц на любой вкус и кошелёк. ',15,'2010-04-26 16:58:39','2010-04-26 17:11:15',1,'ru');
/*!40000 ALTER TABLE `questions` ENABLE KEYS */;
UNLOCK TABLES;

