INSERT INTO `view_article_translations` VALUES (5,7,'ru','Добро пожаловать на наш сайт!','Если Вы заглянули к нам, может быть Вам уже известно что Судак - это небольшой курортный город на Юго-Восточном побережье Крымского полуострова. Его пляжи омывает ласковое и чистое Черное море, свежий ветер проносится по живописным невысоким горам и холмам, обступившим Судакскую долину, а количество солнечных дней в году является одним из наибольших в Украине. \r\n','2010-02-20 14:36:22','2010-02-26 08:50:22'),(6,8,'ru','Добро пожаловать - окончание ','Если Вы никогда не были в Судаке, но хотите с ним познакомиться, на этом сайте Вы можете найти множество информации, надеемся она для Вас окажется интересной и полезной. Те, кто уже был здесь, будут иметь возможность вспомнить как все это было, увидеть множество знакомых мест, которые напомнят о жарком солнце, мягком пляже, ласковом море и, таком желанном долгими зимними вечерами, курортном отдыхе.','2010-02-20 14:42:20','2010-04-02 06:36:55'),(7,7,'en','Welcome on our site!','If you glanced to us, maybe, you already know that Sudak is a small resort city on South-east coast of the Crimean peninsula. His beachs are washed by the affectionate and clean Black sea. Fresh wind sweeps over on picturesque but not high mountains and hills which surrounded Sudak valley. An amount of sun days in a year is one of most in Ukraine. ','2010-02-20 15:39:04','2010-02-20 15:39:04'),(8,8,'en','Welcome on our site! - part 2','If you never were in Sudak but you want to visit it, on this site you can find the great number of information. We hope it will appear interesting and useful for you. Those, who already was here, will have the opportunity to remember as all of it was. They can see the great number of the acquainted places. You will remember about a hot sun, soft beach, affectionate sea and such desirable vacation at the resort.','2010-02-20 15:54:15','2010-02-21 17:24:30'),(9,9,'ru','Предупреждение - пользователь вошел гостем','этот вопрос задается Вами непосредственно менеджеру сайта. В этом случае ответ на вопрос будет дан максимально быстро. Если Вы желаете знать мнение других посетителей этого сайта по этому вопросу, задайте его, пожалуйста, в нашем ','2010-02-20 19:03:15','2010-02-20 19:03:15'),(10,9,'en','Warning - an user entered a guest','this question is set by you directly to the manager of site. In this case an answer for a question will be given maximally quickly. If you wish to know opinion of other visitors of this site through this question set your question in','2010-02-20 19:07:54','2010-02-20 19:07:54'),(11,11,'ru','Рекламодателям','Так как миссией сайта является предоставление посетителям максимального количества интересной и полезной информации об одном из интереснейших мест Крыма - городе Судак, потенциальный рекламодатель получает возможность заявить о своих товарах или услугах целевой аудитории, нацеленной на поиск возможностей посетить в качестве туристов один из курортов Крыма.\r\n\r\n','2010-02-21 13:56:50','2010-02-21 13:56:50'),(12,11,'en','Advertisers','The mission of site is a grant to the visitors of maximal interesting and useful information content about one of the most interesting places of Crimea - city Sudak. A potential advertiser gets possibility to declare about his commodities or services to wide target audience. This audience searches possibility to visit one of resorts of Crimea as tourists.','2010-02-21 14:01:25','2010-02-21 14:01:25'),(13,7,'uk','Ласкаво просимо на наш сайт!','Якщо Ви завітали до нас, можливо Вам вже відомо що Судак - це невелике курортне місто на Південно-Східному узбережжі Кримського півострова. Його пляжі омиває ласкаве і чисте Чорне море. Свіжий вітер проноситься мальовничими невисокими горами і пагорбами, які оточили Судацьку долину. Кількість сонячних днів у році тут є однією з найбільших в Україні.','2010-02-26 08:49:55','2010-02-26 08:49:55'),(14,8,'uk','Ласкаво просимо - закінчення','Якщо Ви ніколи не були в Судаку але хочете з ним познайомитися, на цьому сайті Ви зможете знайти багато інформації, сподіваємося вона для Вас виявиться цікавою і корисною. Ті, хто вже був тут, будуть мати можливість згадати як все це було і побачити безліч знайомих місць. Ви згадаєте про палке сонце, м\'який пляж, ласкаве море і такий бажаний курортний відпочинок.','2010-02-26 08:53:42','2010-02-26 08:53:42'),(15,9,'uk','Попередження - користувач увійшов гостем','це питання задається Вами безпосередньо нашому менеджеру. У цьому випадку відповідь буде надано максимально швидко. Якщо Ви бажаєте знати думку інших відвідувачів цього сайту з цього питання, задайте його в','2010-02-26 08:57:17','2010-02-26 08:57:17'),(16,11,'uk','Рекламодавцям','Місією сайту є надання відвідувачам максимальної кількості цікавої та корисної інформації про одне з найцікавіших місць Криму - місті Судак. Потенційний рекламодавець отримує можливість заявити про свої товари або послуги великій цільовій аудиторії, представники якої шукають можливість відвідати один з курортів Криму в якості туристів.','2010-02-26 09:00:48','2010-02-26 09:00:48');
