INSERT INTO `view_articles` VALUES (7,'Добро пожаловать на наш сайт!','Если Вы заглянули к нам, может быть Вам уже известно что Судак - это небольшой курортный город на Юго-Восточном побережье Крымского полуострова. Его пляжи омывает ласковое и чистое Черное море, свежий ветер проносится по живописным невысоким горам и холмам, обступившим Судакскую долину, а количество солнечных дней в году является одним из наибольших в Украине. \r\n',NULL,'2010-02-20 14:36:22','2010-02-26 08:50:22','Если Вы заглянули к нам, может быть Вам уже известно что Судак - это небольшой курортный город на Юго-Восточном побережье Крымского полуострова. Его пляжи омывает ласковое и чистое Черное море. Свежий ветер проносится по живописным невысоким горам и холмам, которые окружили Судакскую долину. Количество солнечных дней в году является одним из наибольших в Украине. \r\n'),(8,'Добро пожаловать - окончание ','Если Вы никогда не были в Судаке, но хотите с ним познакомиться, на этом сайте Вы можете найти множество информации, надеемся она для Вас окажется интересной и полезной. Те, кто уже был здесь, будут иметь возможность вспомнить как все это было, увидеть множество знакомых мест, которые напомнят о жарком солнце, мягком пляже, ласковом море и, таком желанном долгими зимними вечерами, курортном отдыхе.',NULL,'2010-02-20 14:42:20','2010-04-02 06:36:55','Если Вы никогда не были в Судаке но хотите с ним познакомиться, на этом сайте Вы можете найти множество информации. Надеемся она для Вас окажется интересной и полезной. Те, кто уже был здесь, будут иметь возможность вспомнить как все это было и увидеть множество знакомых мест. Вы вспомните о жарком солнце, мягком пляже, ласковом море и таком желанном курортном отдыхе.'),(9,'Попередження - користувач увійшов гостем','це питання задається Вами безпосередньо нашому менеджеру. У цьому випадку відповідь буде надано максимально швидко. Якщо Ви бажаєте знати думку інших відвідувачів цього сайту з цього питання, задайте його в',NULL,'2010-02-20 19:03:15','2010-02-26 08:57:17','этот вопрос задается Вами непосредственно менеджеру сайта. В этом случае ответ на вопрос будет предоставлен максимально быстро. Если Вы желаете знать мнение других посетителей этого сайта по этому вопросу задайте Ваш вопрос в  '),(11,'Рекламодавцям','Місією сайту є надання відвідувачам максимальної кількості цікавої та корисної інформації про одне з найцікавіших місць Криму - місті Судак. Потенційний рекламодавець отримує можливість заявити про свої товари або послуги великій цільовій аудиторії, представники якої шукають можливість відвідати один з курортів Криму в якості туристів.',NULL,'2010-02-21 13:56:50','2010-02-26 09:00:48','Миссией сайта является предоставление посетителям максимального количества интересной и полезной информации об одном из интереснейших мест Крыма - городе Судак. Потенциальный рекламодатель получает возможность заявить о своих товарах или услугах широкой целевой аудитории. Эта аудитория ищет возможности посетить один из курортов Крыма в качестве туристов.\r\n\r\n');
